(4, 'terms', 'terms', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>السياسات والإجراءات والخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>شكرًا لك على استخدام <span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>تاريخ آخر تعديل: <span dir=\"LTR\">04/08/2021</span></strong></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align: center;\"><strong>اتفاقية ترخيص المستخدم النهائي (الاتفاقية) هي اتفاقية قانونية بينك (أنت) ومؤسسة قوة لتقنية المعلومات (سجل تجاري رقم ٢٢٥١٤٩٨٩٠٦) المالكة لتطبيق <span dir=\"LTR\">&nbsp;EJARLY </span>( نحن أو نحن) لاستخدام نظام تأجير وخدمات من شخص إلى شخص عبر موقع و تطبيق إيجارلي <span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>١-كيف تنطبق هذه الشروط :</strong></p>\r\n\r\n<p dir=\"RTL\">١.١ -من خلال الوصول إلى او استخدام أي منتج او خدمة نقدمها من تطبيق <span dir=\"LTR\">EJARLY</span> او الموقع الالكتروني واي تقنية اخرئ تابعة او ذات صلة بنظام <span dir=\"LTR\">EJARLY ,</span> والامتثال لهذه الشروط التي تنطبق على جميع المستخدمين والزوار وغيرهم ممن يصلون إلى خدمة <span dir=\"LTR\">EJARLY</span> فإنك توافق على الامتثال والالتزام بشروط الخدمة هذه (&quot;الشروط&quot;). عندما تُدرج المنتجات والخدمات للإيجار بصفتك &quot;مالكًا&quot; ، فإنك توافق على الامتثال لقواعد المالكين ، وعندما تستأجر منتجات وخدمات من مالك بصفتك &quot;مستأجرًا&quot; ، فإنك توافق على الامتثال لقواعد المستأجرين . إذا كنت لا توافق على أي من سياسة الاجراءات وشروط الاستخدام و الخصوصية ،، فلا يحق لك الوصول الي الخدمة واستخدام تطبيق او موقع <span dir=\"LTR\">EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.2 -يجب قراءة هذه الاتفاقية بالاقتران مع سياسة الخصوصية الخاصة بنا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.3 -تحديثات<span dir=\"LTR\">. EJARLY </span>&nbsp;قد تقوم بتحديث شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه في أي وقت ، وسوف تقوم <span dir=\"LTR\">EJARLY&nbsp; </span>&nbsp;بنشر النسخة المحدثة من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه على الموقع. أنت تدرك وتوافق على أنه سيتم اعتبارك موافقًا على شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة إذا كنت تستخدم الخدمة بعد نشر شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة أنت مسؤول عن مراجعة أحدث إصدار من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; . إذا كنت لا توافق في أي وقت على أي جزء من شروط الاستخدام والسياسات والإجراءات والخصوصية &nbsp;هذه ، فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٢-</strong> <strong>وصف خدمات</strong><span dir=\"LTR\">&nbsp; &nbsp;&nbsp;&nbsp;Ejarly</span>&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>٢.١ </strong>&nbsp;<strong>-</strong> إيجارلي <strong><span dir=\"LTR\">(Ejarly)</span></strong> هي منصة تأجير تتيح لأفراد المجتمع مشاركة ممتلكاتهم لبعضهم البعض ، نمكن أصحاب الممتلكات (المؤجرون ) الاستفادة من ممتلكاتهم المركونة والغير مستغلة من كسب المال منها من خلال تأجيرها لأفراد أخرون (المستأجرين )، نقوم بربطهم بالأفراد الذين يحتاجون (المستأجرين )&nbsp; الى أشياء لاستخدام قصير الاجل أو للاستخدام الفردي واستئجارها وتوفير المال . تقوم المنصة على ربط و تسهيل التواصل لعملية التأجير بين الطرفين في بيئة أمنة وموثوقة&nbsp; قدر المستطاع&nbsp;&nbsp;&nbsp; .</p>\r\n\r\n<p dir=\"RTL\">إجارلي<strong><span dir=\"LTR\"> (Ejarly)&nbsp; </span></strong>ليست سوى وسيط لأي معاملة بين المالكين والمستأجرين لتأجير العناصر والخدمات على منصة إجارلي <strong><span dir=\"LTR\">( Ejarly) </span></strong>عندما يؤجر المالك منتجًا أو خدمة للمستأجر ، فإنهم يبرمون عقدًا مع بعضهم البعض مباشرة ، وليس مع <strong><span dir=\"LTR\">Ejarly</span></strong>، لا يمكن اعتبار &nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>مسؤولة ، وإلى أقصى حد يسمح به القانون ، تستبعد المسؤولية عن سلوك استخدامات <strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">سوف تساعد <strong><span dir=\"LTR\">Ejarly </span></strong>&nbsp;في تسهيل حل النزاعات. لا يمكن أن تضمن <strong><span dir=\"LTR\">Ejarly</span></strong> حقيقة أو دقة أو سلامة أو وجود أو شرعية أي منتج أو خدمة مدرجة للإيجار. التحقق من الهوية ليس مصادقة على منتجات المالك أو مصادقة على المستأجر. لا تصادق <strong><span dir=\"LTR\">Ejarly</span></strong> أو تضمن منتجات للإيجار على المنصة. يجب على العملاء توخي الحرص عند استئجار منتج أو خدمات على <strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">إذا لم يمتثل المالك أو المستأجر لشروط الخدمة ، يحق لـ <strong><span dir=\"LTR\">Ejarly</span></strong> إزالة القوائم و / أو إلغاء أي معاملات <strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣- وصف المستخدمين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١- &nbsp;الملاك ( المؤجرون )</strong></p>\r\n\r\n<p dir=\"RTL\">مالكين المنتجات&nbsp; الإعلان عن سلع او خدمات للإيجار داخل <strong><span dir=\"LTR\">ejarly</span></strong> ( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب&nbsp; الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة&nbsp; (&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.١-</strong> بصفتك مالكًا ، عندما تقوم &nbsp;بتأجير عنصر أو تقديم خدمة للمستأجر ، فإنك تتعهد بالامتثال لقواعد وشروط الخدمة الخاصة بالمالكين ، وتقر بأنك تدخل في عقد مباشر مع المستأجر وليس عقدًا مع <strong><span dir=\"LTR\">Ejarly.</span></strong>،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٢-</strong> بصفتك مالكًا ، فإنك تقر بأن المستأجر لا يمثل أو يتحكم فيه <strong><span dir=\"LTR\">Ejarly. </span></strong>أنت توافق على أن <strong><span dir=\"LTR\">Ejarly</span></strong> ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المستأجر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٣</strong> -بصفتك مالكًا ، فإنك توافق على الامتثال لقواعد المالكين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المالكين وستكون مسؤولاً عن أي تعويض للمقترض فيما يتعلق بأي عدم امتثال. يتضمن ذلك التأكد من مطابقة المنتج المدرج للإيجار مع الوصف الموجود على المنصة. أنت تقر بأن <strong><span dir=\"LTR\">Ejarly</span></strong> ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.١.٤ -</strong> أي تعويض للمستأجر عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٥ -</strong> أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢- المستأجرين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١-&nbsp; </strong>المستأجرين من يقومون باستئجار منتجات من المالك واستخدامها لوقت مدد بينهم ومن ثم ارجاعة للمالك ، أنت كمستأجر توافق على أنه عند استئجار عنصر او خدمة من مالك في <strong><span dir=\"LTR\">Ejarly</span></strong> ، فإنك توافق على الامتثال لقواعد المستأجرين وشروط الخدمة، وتقر بأنك تدخل في عقد مباشر مع المالك وليس عقدًا مع <strong><span dir=\"LTR\">ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٢-</strong> بصفتك مستأجرًا ، فإنك تقر بأن المالك لا يمثل أو يتحكم فيه <strong><span dir=\"LTR\">Ejarly. </span></strong>أنت توافق على أن <strong><span dir=\"LTR\">Ejarly</span></strong> ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المالك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٣-</strong> بصفتك المستأجر ، فإنك توافق على الامتثال لقواعد المستأجرين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المستأجرين وستكون مسؤولاً عن أي تعويض للمالك فيما يتعلق بأي عدم امتثال. يتضمن ذلك فقدان أو تلف المنتج الذي استأجرته. أنت تقر بأن <strong><span dir=\"LTR\">ejarly </span></strong>ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٤-</strong> أي تعويض للمالك عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٥-</strong> أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٦-</strong> بصفتك المستأجر أنت تقر وتضمن أنك على دراية بنوع المنتج الذي يتم تأجيره والتعديلات المطلوبة للتشغيل الآمن للمنتج واستخدامه ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٧-</strong> لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٨-</strong> أنت مسؤول مسؤولية كاملة عن سلامتك وسلامة أي طرف ثالث أثناء استخدام المنتج ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩-</strong> <strong>سوف :</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.١-</strong> تعامل المنتج بنفس درجة العناية على الأقل كما لو كانت ملكيتك الخاصة ، وعلى أي حال مع العناية المعقولة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.٢-</strong> إعادة المنتج إلى المُقرض بنفس الحالة التي تلقيتها ذلك في التاريخ والوقت المستحق وفي المكان المحدد في القائمة المقبولة</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.٣- </strong>أنت تدرك أنه ستكون هناك رسوم إضافية إذا تم إرجاع المنتج في وقت أو تاريخ أو موقع مختلف عما هو مذكور في القائمة المقبولة ، بما في ذلك الرسوم المتأخرة أو رسوم الإيجار الإضافية ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠-</strong> <strong>ستضمن أن المنتج:</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.١-</strong>ستضمن أن المنتج&nbsp; يظل ملكية شخصية ولا يصبح عنصرًا أساسيًا في الممتلكات العقارية ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.٢-</strong>ستضمن أن المنتج يتم الاحتفاظ به خاليًا من أي امتيازات أو أعباء ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠.٣-</strong>ستضمن أن المنتج يتم تخزينه في مكان وبيئة آمنة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١-</strong>تقر بأن المُقرض قد يستعيد ملكية المنتج في أي وقت دون إخطارك مسبقًا إذا:</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.١-</strong> تم استخدام المنتج بشكل ينتهك القانون ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٢-</strong> يبدو أنه قد تم التخلي عن المنتج ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣٣.٢.١١.٣-</strong> المنتج تُستخدم في انتهاك لاتفاقية التأجير ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١١.٤-</strong> أنك قدمت تحريفًا للمقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٥-</strong> فشلت في إعادة المنتج عند استحقاقه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٢- </strong>ستدفع للمالك ما يصل إلى قيمة الاستبدال الكاملة للمنتج مقابل جميع الخسائر و / أو الأضرار التي تلحق بالمنتج ، باستثناء حالات التآكل والتلف العادية فقط ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٣- </strong>تقر بأن المنتج يظل ملكية حصرية للمقرض ويخضع للفحص من قبل المُقرض في أي وقت بناءً على طلب المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٤- </strong>أنت تدرك وتقر بأن المنتج مقدم من قبل المُقرض &quot;كما هو&quot; وأن المُقرض لا يقدم أي ضمانات بخلاف تلك المنصوص عليها صراحةً في القسم) &nbsp;أعلاه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٥- </strong><strong>لن تقوم </strong><strong>:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.١- </strong>بإزالة أي ملصقات من المنتج تحدد المُقرض على أنه المالك ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.٢-</strong> تعديل المنتج بأي طريقة دون الحصول على موافقة كتابية مسبقة من المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٤- حسابك الخاص في إجارلي:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١- </strong>&nbsp;من أجل الوصول إلى نظام إجارلي <strong><span dir=\"LTR\">(ejarly) </span></strong>&nbsp;والحصول على خدمات &nbsp;إجارلي <strong><span dir=\"LTR\">(ejarly) &nbsp;</span></strong>، يجب عليك إنشاء حساب مستخدام :</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.١- </strong>&nbsp;عنوان بريدك الإلكتروني (الحساب)</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٢- </strong>&nbsp;رقم جوالك</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٣- </strong>&nbsp;وبيانات الهوية الوطنية</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٤- </strong>&nbsp;اسم مستخدم</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٥- </strong>&nbsp;وستحتاج إلى إنشاء كلمة مرور لحسابك - نحن نشجعك على استخدام كلمات مرور &quot;قوية&quot;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;(كلمات مرور تستخدم مزيجًا من الأحرف الكبيرة والصغيرة والأرقام والرموز) مع حسابك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢- </strong>&nbsp;&nbsp;يجب أن تبلغ من العمر السن القانوني فوق١٨ سنه ليتيح لك عرض ممتلكاتك او خدمات والتعامل والتأجير من المالك للدخول في اتفاقية ملزمة قانونًا لاستخدام نظام <strong><span dir=\"LTR\">ejarly. </span></strong>إذا كان عمرك أقل من العمر المسموح فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢- </strong>&nbsp;&nbsp;تقع على عاتقك مسؤولية الحفاظ على سرية تفاصيل تسجيل الدخول الخاصة بك وأي أنشطة تحدث ضمن حسابك. إذا كانت لديك أي مخاوف بشأن إساءة استخدام حسابك ، فيجب عليك التواصل بنا على <strong><span dir=\"LTR\">info@ejarly.net </span></strong>&nbsp;على الفور لإعلامنا<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٣-</strong> أنت مسؤول عن الحفاظ على سرية كلمة المرور لحسابك وستكون مسؤولاً عن جميع المستخدمين من خلال تسجيلك و / أو تسجيل الدخول ، سواء أكان ذلك مصرحًا به أم غير مصرح به. أنت توافق على إخطارنا فورًا بأي استخدام غير مصرح به للتسجيل أو الحساب أو معلومات الفواتير أو كلمة المرور الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\"><strong>٥-<span dir=\"LTR\">. </span>كيفية استخدام <span dir=\"LTR\">EJARLY</span> :</strong></p>\r\n\r\n<p dir=\"RTL\">بعد إتمام عملية التسجيل من قبل المالك والمستأجر وتوثيق الحساب :</p>\r\n\r\n<p dir=\"RTL\">٥.١- يقوم المؤجرون بإضافة او اعلان ممتلكاته من منتجات وخدمات للتأجير في تطبيق <span dir=\"LTR\">EJARLY</span> بشرط مطابق للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٥.٢- ويقوم المستأجر بتصفح التطبيق لتأجير منتجات وخدمات او طلب منتجات وخدمات من المالك</p>\r\n\r\n<p dir=\"RTL\">٥.٣- طلب تأجير : يمكن للمستأجرين طلب حجز العناصر التي يوفرها المقرضون عن طريق تقديم طلب إلى المُقرض من خلال نظام <span dir=\"LTR\">EJARLY</span> وإدراج تاريخ بدء الحجز المطلوب وتاريخ اكتمال الحجز وتفاصيل الطلب وإرساله للمالك ،</p>\r\n\r\n<p dir=\"RTL\">٥.٤- الموافقة : سيقوم نظام <span dir=\"LTR\">EJARLY</span> بإخطار المالك بالطلب المرفوع من المستأجر ويحق للمالك القبول او رفض الطلب مع ذكر السبب وفي حال تم قبول الطلب سوف يقوم النظام بتأكيد الطلب وفتح عملية تأجير موثقة داخل <span dir=\"LTR\">EJARLY</span> و إبلاغ المستأجر بقبول المالك للطلب ، وتنبيه الطرفين بالتواصل داخل التطبيق <span dir=\"LTR\">EJARLY</span> لتحديد مكان وموعد الاتقاء واكمال العملية ،</p>\r\n\r\n<p dir=\"RTL\">٥.٥- المعاينة : في تاريخ بدء الحجز ، يجب أن يكون كل المالك المستأجر في الموقع المتفق عليه وننصح بإتباع إرشادات السلامة وقت المعاينة حتى يقوم المالك بتسليم العنصر المؤجر إلى المستأجر، المستآجرون مسؤولون ومسؤولون عن العنصر المستأجر خلال فترة الحجز ويجب أن يتعاملوا مع العنصر المستأجر بعناية واحترام. إذا كنت مقترضًا ، فستكون مسؤولاً عن تغطية تكاليف التلف أو استبدال أي أضرار أو خسارة للعنصر المستأجر أثناء الحجز ، بالإضافة إلى أي أضرار مرتبطة بعدم إعادة العنصر المستأجر في تاريخ اكتمال الحجز و إلى الموقع المحدد<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">٥.٥.١- &nbsp;يقوم المالك بمقابلة المستأجر لتسليم المنتج للمستأجر وشرح آلية عمل المنتج وتوثيق المنتج قبل تسليمه للمستأجر عن طريق تصويره بحالته وهوا يعمل ومن ثم إتمام المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٥.٢- يقوم المستأجر بمعاينة المنتج المراد تأجيره والتأكد منه وتوثيق المنتج عن طريق تصويره بحالته قبل الاستلام ومن ثم تأكيد المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٦- الدفع : بعد إتمام مرحله المعاينه يتم دفع مبلغ التأجير من المستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٦.١- يقوم المستأجر بدفع مبلغ التأجير للمالك عن طريق وسائل الدفع المتاحه لدئ <span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧-الاستلام: بعد إتمام مرحله الدفع يجب علئ آلمالك تسليم المنتج للمستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٧.١-يقوم المالك بتسليم المنتج للمستأجر وتأكيد التسليم عن طريق التطبيق<span dir=\"LTR\"> EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧.٢ -يقوم المستأجر بعد استلام المنتج من المالك يقوم المستأجر بتأكيد استلام المنتج عن طريق التطبيق <span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٨-الاسترجاع : عند العودة إلى المالك في الموقع المحدد</p>\r\n\r\n<p dir=\"RTL\">٥.٨.١-المالك&nbsp; سيفحص المالك السلعة المؤجرة للتأكد من أنها في نفس الحالة التي كانت عليها عندما تم تسليمها إلى المستأجر. بعد الفحص ، قد يتم فرض رسوم التنظيف على المستأجر اعتمادًا على حالة العنصر المستأجر وتأكيد استرجاع المنتج .</p>\r\n\r\n<p dir=\"RTL\">٥.٨.٢-يقوم المستأجر بتسليم المنتج للمالك وتمام استرجاع المنتج ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٥.٩- التقييم : يقوم كلا الطرفين بتقييم عملية التأجير</p>\r\n\r\n<p dir=\"RTL\"><strong>٦- يسمح نظام <span dir=\"LTR\">EJARLY</span> &nbsp;بما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong> &nbsp;<strong>المؤجرون</strong> : &nbsp;مالكين المنتجات &nbsp;الإعلان عن سلع او خدمات للإيجار داخل <strong><span dir=\"LTR\">ejarly</span></strong> ( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب &nbsp;الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة &nbsp;(&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong> &nbsp;أنت تقر وتضمن أنك</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.١-</strong> &nbsp;&nbsp;أنت المالك الوحيد للمنتج أو أن لديك وكالة كاملة أو سلطة أخرى لتقديم المنتج إلى المستأجر ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٢-</strong> &nbsp;&nbsp;&nbsp;تم وصف المنتج بدقة في قائمة عرض المنتج ، بما في ذلك الحالة الحالية وأي أخطاء أو عيوب أو مشاكل معروفة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٣-</strong> &nbsp;&nbsp;&nbsp;باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة &nbsp;&nbsp;&nbsp;الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٤-</strong> &nbsp;&nbsp;&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٥-</strong> &nbsp;&nbsp;&nbsp;يجب ألا تعرض خدمة او منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٦-</strong> &nbsp;&nbsp;&nbsp;عدم تبادل بيانات التواصل مع المستآجر ويتم التواصل مع المستأجر فقط عن طريق الرسائل داخل التطبيق <strong><span dir=\"LTR\">Ejarly</span></strong> وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمستأجر للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٧-</strong> &nbsp;&nbsp;&nbsp;لا يتم تسليم أي عنصر إلا للمقترض بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة <strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٨-</strong> &nbsp;&nbsp;&nbsp;يجب عليك فقط تسليم العنصر إلى الشخص المستآجر المستخدم في <strong><span dir=\"LTR\">Ejarly</span></strong> وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;<strong>٦.١.٩-</strong> &nbsp;&nbsp;&nbsp;لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١٠-</strong> يمكنك إزالة المنتج أو إلغاء اتفاقيتك لإقراض عنصر للمقترض في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار. إذا قمت بإلغاء اتفاقية استئجار عنصر لمستأجر قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي <strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١١-</strong> &nbsp;&nbsp;بصفتك مالكآ (مؤجر) ، فأنت وحدك المسؤول عن تكلفة أي إصلاحات أو تعديلات على المنتج لم تكن ضرورية بسبب الضرر الناجم عن المستأجر او وجود عيوب لم يتم وصفها أو تصويرها في القائمة المنشورة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢-</strong> &nbsp;&nbsp;<strong>بالمستأجر </strong>&nbsp;: عندما توافق على استئجار عنصر مع المالك ، يمنحك المالك حقًا محدودًا لاستخدام هذا العنصر خلال فترة الاستئجار ذات الصلة. هذا الحق شخصي لك ولا يُسمح لك بمنح هذا الحق لأي شخص آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong> &nbsp;&nbsp;&nbsp;&nbsp;أنت مسؤول عن ضمان ما يلي<strong><span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong> أنك تمتثل لجميع القوانين المعمول بها عند استخدام العنصر ؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>٦.٢.٢-</strong>فإنك تقر أنك ستكون قادرًا على دفع الإيجار ولديك أموال لسداد ثمن العناصر المفقودة أو التالفة. قد تتطلب<strong><span dir=\"LTR\"> Ejarly </span></strong>إيداعًا منك&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; يصل إلى القيمة المقدرة (المحددة من قبل المقرض) للبند المستأجر المقترض وتوافق على أنه يمكننا خصم القيمة المقدرة من حسابك او المحفظه في حالة تلف العنصر أو الإخفاق في إرجاع العنصر. بحلول تاريخ العودة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">تاريخ العودة ورسوم</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٣-</strong> أنت توافق على أنه إذا تم إرجاع عنصر ما بعد تاريخ الإرجاع (التاريخ والوقت المتفق عليه لإرجاع عنصر) ، فسيتم فرض رسوم تصل إلى <strong><span dir=\"LTR\">5 </span></strong>اضعاف قيمة الإيجار لكل يوم إضافي على تاريخ الإرجاع وتوافق على خصم هذا المبلغ من حسابك الحساب<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٤-</strong> لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٥-</strong> يجب ألا تعرض طلب منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٦-</strong>عدم تبادل بيانات التواصل مع المالك ويتم التواصل مع المالك فقط عن طريق الرسائل داخل التطبيق <strong><span dir=\"LTR\">Ejarly</span></strong> وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمالك للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٧-</strong> لا يتم تسليم أي عنصر إلا للمالك بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة <strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٨-</strong> يجب عليك فقط ارجاع المنتج إلى الشخص المالك المستخدم في <strong><span dir=\"LTR\">Ejarly</span></strong> وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٩-</strong> لك مطلق الحرية في الغاء عملية التأجير في حال المنتج مخالف او مختلف عن المعروض في منصات <strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٠-</strong> ستكون مسؤولاً عن أي خسارة أو تلف للعنصر الذي استأجرته. يرجى الاطلاع على الفقرة المعلومات حول كيفية تعاملنا مع الخلافات بين المقترضين والمقرضين ، بما في ذلك أي نزاعات في حالة تلف العنصر أو فقده أو سرقته<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١١-</strong> يمكنك إلغاء طلب تأجير المنتج في أي وقت قبل قبول المقرض للطلب او في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار ، إذا قمت بإلغاء اتفاقية استئجار عنصر المالك قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي <strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٢-</strong>لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٣-</strong> أنك تمتثل لأية توجيهات معقولة يقدمها المُقرض من أجل استخدام العنصر بأمان ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٤-</strong> باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة&nbsp;&nbsp;&nbsp; الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٥-</strong> إذا أخفقت في إرجاع عنصر بحلول الموعد النهائي المتفق عليه ، فيجب عليك الاتصال بالمُقرض و / أو <strong><span dir=\"LTR\">Ejarly</span></strong> لإعلامهم بمجرد علمك بأنك ستفوت الموعد النهائي. ستحتاج أيضًا إلى الحجز والدفع مقابل الوقت الممتد على الفور. قد لا يكون المُقرض قادرًا على استيعاب التمديد وفي هذه الحالة تقع على عاتقك مسؤولية إعادة العنصر (العناصر) إلى المُقرض خلال إطار زمني يناسب المُقرض. إذا لم تقم بذلك ، فستكون مسؤولاً عن دفع الرسوم المتأخرة ، والتي ستكون وتصل الى <strong><span dir=\"LTR\">5</span></strong>اضعاف رسوم الإيجار عن الفترة التي تأخر فيها العنصر (&quot;الرسوم المتأخرة&quot;). أنت توافق على أن <strong><span dir=\"LTR\">Ejarly</span></strong> يمكنها خصم هذا المبلغ من بطاقتك أو حسابك المصرفي دون إذن آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٧- رسوم الحجز وشروط الدفع</strong></p>\r\n\r\n<p dir=\"RTL\">٧.١ - لا توجد رسوم لإنشاء حساب. ومع ذلك ، فإننا نفرض رسومًا على كل معاملة تتم من خلال نظام <span dir=\"LTR\">EJARLY </span><span dir=\"LTR\">&nbsp;(</span>رسوم المعاملات). على وجه الخصوص ، نحن نفرض رسومًا على<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٧.٢ - &nbsp;رسوم على كل عملية مكتملة ، عمولة <span dir=\"LTR\">EJARLY</span> &nbsp;تصل الى (<span dir=\"LTR\">15</span>٪) وهي الرسوم التي يتم عرضها للمالكين بعد انتهاء عملية التأجير ويحق لـ <span dir=\"LTR\">EJARLY </span>تغيرها بدون اخطار مسبق للمستخدمين ويجب على المستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٣ - &nbsp;رسوم الخدمة سوق يتم احتساب رسوم للخدمه من المستأجرين لكل عمليه تأجير مكتمله تقدر بقيمه تصل الى ٥ ريال ويحق لـ <span dir=\"LTR\">EJARLY </span>تغيرها بدون اخطار مسبق للمستخدمين ويجب علئ آلمستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٤ - &nbsp;رسوم تمميز المنتج :تمميز المنتج خدمة تقدمها <span dir=\"LTR\">EJARLY</span>للاعلان عن المنتجات لزياده فرصه استأجارها من المستأجرين وتقون بقيمه رمزيه تحدد في الإعلان</p>\r\n\r\n<p dir=\"RTL\"><strong>٧.١ - </strong>&nbsp;<strong>الضريبة :</strong> المالك اوالمستأجر تقر بأنك المسؤول الوحيد عن دفع الضرائب المطبقة (إن وجدت) المستحقة عليك وفقًا لاستخدامك&nbsp; أنت وحدك المسؤول عن جميع الالتزامات الضريبية المرتبطة بمعاملة التأجير الخاصة بك. &quot;الضريبة&quot; تعني أي ضرائب القيمة المضافة (<strong><span dir=\"LTR\">VAT</span></strong>) أو أي ضرائب أخرى قد يُطلب من المُقرض أو المستأجر تحصيلها و / أو تحويل إلى أي وكالات حكومية (&quot;السلطات الضريبية&quot;). تختلف القوانين في الولايات القضائية المختلفة. <strong><span dir=\"LTR\">&nbsp;Ejarly </span></strong>لا يمكنها ولا تقدم نصائح متعلقة بالضرائب لأي مقرضين . يرجى استشارة مستشارك الضريبي لتحديد المعاملة الضريبية لأنشطتك في الخدمة أنت توافق على تعويض <strong><span dir=\"LTR\">Ejarly</span></strong>، ومسؤوليها ، ومديريها ، وموظفيها ، والشركات التابعة لها ، والشركات التابعة لها ، والوكلاء ، والخلفاء والمتنازل لهم من وضد أي التزامات أو أضرار أو خسائر أو تكاليف أو مصاريف أو رسوم تسوية (بما في ذلك المحامين المعقولون &#39;&#39; ، والدفاع عنها وحمايتها. الرسوم وتكاليف الدفاع ومصاريف التحقيق وتكاليف الاكتشاف وتكاليف المحكمة) الناشئة عن خرقك لهذا القسم</p>\r\n\r\n<p dir=\"RTL\"><strong>٨- الأمن</strong></p>\r\n\r\n<p dir=\"RTL\">أمن الحساب. الحفاظ على أمان الحساب أمر في غاية الأهمية. أنت وحدك المسؤول عن الحفاظ على سرية كلمة مرور حسابك. أنت توافق على إخطار<strong><span dir=\"LTR\">Ejarly </span></strong>على الفور إذا علمت بأي استخدام غير مصرح به لكلمة المرور الخاصة بك أو لحسابك تهتم ِ<strong><span dir=\"LTR\">Ejarly </span></strong>&nbsp;بسلامة وأمن معلوماتك الشخصية. ومع ذلك ، لا يمكننا أن نضمن أن الأطراف الخارجية غير المصرح لها لن تكون قادرة أبدًا على هزيمة إجراءاتنا الأمنية أو استخدام معلوماتك الشخصية لأغراض غير لائقة. أنت تقر بأنك تقدم معلوماتك الشخصية على مسؤوليتك الخاصة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٩- المسؤولية:</strong> <strong>التفاعلات والنزاعات بين المالك والمستأجر</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">أنت توافق على أنه عندما تؤجر أو تستأجر منتج او خدمة او طلب منتج او خدمة من <strong><span dir=\"LTR\">Ejarly </span></strong>، فإن معاملة التأجير تكون فقط بينك وبين المالك و / أو المستآجر ، كما هو معمول به ، وأن<strong><span dir=\"LTR\"> Ejarly </span></strong>ليس طرفًا في عملية التأجير. لدى<strong><span dir=\"LTR\"> Ejarly </span></strong>الحق ، وليس الالتزام ، في مراقبة أي نزاع و / أو مساعدته و / أو حله بين المؤجر والمستأجر - بما في ذلك على سبيل المثال وليس الحصر ، من خلال فرض القيمة التقديرية الكاملة للالتزام الحدث الذي تقرر فيه أن المقترض قد سرق أو فقد أو دمر عناصر المالك<strong><span dir=\"LTR\">.</span></strong>في حالة عدم تمكن المالك والمستأجر من حل نزاع بينهما مباشرة ، فقد يطلبان من <strong><span dir=\"LTR\">Ejarly</span></strong> التوسط في النزاع. قد تقبل <strong><span dir=\"LTR\">Ejarly</span></strong>أو ترفض مثل هذا الطلب لتكون وسيطًا وفقًا لتقديرها الخاص. إذا قبلت <strong><span dir=\"LTR\">Ejarly</span></strong> طلب العمل كوسيط ، فيجوز لها فرض رسوم من أي مبالغ تحدد <strong><span dir=\"LTR\">Ejarly</span></strong>أنها مستحقة الدفع من قبل المستأجر لتعويض المالك عن أي خسارة أو ضرر يلحق بالمالك. العنصر. سنقوم بتحميل هذا المبلغ على المستأجر بالإضافة إلى أي مبالغ يطلب من المستأجر دفعها للمالك ، والتي قد تشمل الرسوم المنسوبة إلى تلك الأيام التي لم يتمكن فيها المالك من إقراض السلع إلى مستأجرين آخرين.</li>\r\n	<li dir=\"RTL\">&nbsp;في غضون إطار زمني معين بعد إكمال عملية التاجير ، يمكن للمؤجرين والمستآجرين ترك مراجعة عامة (&quot;مراجعة&quot;) وتقديم تصنيف نجمي (&quot;تصنيف&quot;) عن بعضهم البعض. تعكس التقييمات أو المراجعات آراء المستخدم الفردي ولا تعكس آراء <strong><span dir=\"LTR\">Ejarly</span></strong>. لم يتم التحقق من التقييمات والمراجعات من قبل<strong><span dir=\"LTR\"> ejarly </span></strong>للتأكد من دقتها وقد تكون غير صحيحة أو مضللة. يجب أن تكون التقييمات والمراجعات دقيقة ولا يجوز أن تحتوي على أي لغة مسيئة أو تشهيرية. يحظر على المستخدمين التلاعب بنظام التقييمات والمراجعات بأي طريقة ، مثل توجيه طرف ثالث لكتابة مراجعة إيجابية أو سلبية عن مستخدم آخر. تعد التقييمات والمراجعات جزءًا من الملف الشخصي العام للمستخدم ويمكن أيضًا أن تظهر في مكان آخر على خدمة<strong><span dir=\"LTR\"> Ejarly </span></strong>جنبًا إلى جنب مع المعلومات الأخرى ذات الصلة مثل عدد معاملات الإقراض وعدد عمليات الإلغاء ومتوسط ​​وقت الاستجابة وأي معلومات أخرى تعتبرها<strong><span dir=\"LTR\"> Ejarly </span></strong>ذات صلة<strong><span dir=\"LTR\"> .</span></strong></li>\r\n	<li dir=\"RTL\">&nbsp;انت توافق ويحق لـ <strong><span dir=\"LTR\">Ejarly </span></strong>&nbsp;بتقديم للطرف المتضرر بيانات المستخدم الاخر لتقديمها للجهات المختصة ، ولا يترتب على <strong><span dir=\"LTR\">Ejarly </span></strong>&nbsp;او الشركة الام أي مسألة قانونية فأنت توافق بذألك</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">٩.٤- &nbsp;يتم تقديم خدمات<span dir=\"LTR\"> EJARLY </span>على أساس &quot;كما هي&quot;. نحن لا نقدم أي ضمانات ، صريحة أو ضمنية ، وننكر بموجب هذا جميع الضمانات الأخرى وننفيها بما في ذلك ، على سبيل المثال لا الحصر ، الضمانات الضمنية أو شروط القابلية للتسويق أو الاستخدام أو الملاءمة لغرض معين أو عدم التعدي على الملكية الفكرية أو أي انتهاك آخر للحقوق في فيما يتعلق باستخدامك لنظام<span dir=\"LTR\"> EJARLY. </span>هذا يعني أننا غير قادرين على الوعد بأن استخدامك لنظام<span dir=\"LTR\"> EJASRLY </span>لن ينقطع ، دون تأخير ، أو خالي من الأخطاء أو يلبي توقعاتك ، ولا نقدم أي التزام فيما يتعلق بأداء أو توفر نظام<span dir=\"LTR\"> EJARLY </span>في هذه الاتفاقية و إلى الحد الذي نتمكن فيه من القيام بذلك ، فإننا نستبعد أي التزامات قد ينطوي عليها القانون<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>١٠ - كمستخدم لنظام<span dir=\"LTR\"> EJARLY </span>، فأنت تفهم وتوافق على ما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;١٠.١- لن نتحمل نحن أو الشركات التابعة لنا أي مسؤولية تجاهك أو تجاه الآخرين عن أي معاملات غير مصرح بها تتم باستخدام كلمة المرور الخاصة بك أو حسابك أو معلومات الفواتير الخاصة بك ؛ و</p>\r\n\r\n<p dir=\"RTL\">١٠.٢- قد يتسبب الاستخدام غير المصرح به لكلمة المرور الخاصة بك أو لحسابك أو معلومات الفواتير الخاصة بك في تحميلك المسؤولية تجاهنا نحن والمستخدمين الآخرين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٣-عندما تزودنا بمعلوماتك الشخصية ، يجمع نظام<span dir=\"LTR\"> EJARLY </span>هذه المعلومات وفقًا لسياسة الخصوصية الخاصة بنا. لن نتدخل نحن والشركات التابعة لنا في المعلومات بشكل تعسفي ، لكننا نحتفظ بالحق في إزالة المعلومات في بعض الظروف المخففة ، مثل عندما يكون لدينا سبب معقول للشك في أن المستخدم قد يكون احتياليًا أو مزيفًا. نحتفظ أيضًا بالحق في اتخاذ خطوات للتحقق من هويتك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٤- إذا تفاعلت مع نظام<span dir=\"LTR\"> EJARLY </span>بأي طريقة أو أنشأت حسابًا ، فإنك تقوم بذلك على مسؤوليتك الخاصة وفهمك لهذه الاتفاقية. نحن لسنا ولن نكون مسؤولين عن أي إجراءات من قبل مستخدم آخر أو فرد أو شركة أو جمعية أو كيان أو مجموعة أخرى قد تضر بك جسديًا أو ماليًا أو لفظيًا أو رقميًا أو تضايقك بأي شكل من الأشكال. نحن نبذل جهودًا معقولة تجاريًا لتوفير مجتمع نزيه وآمن وجدير بالثقة ولكن لا يمكننا أن نكون مسؤولين عن تصرفات الأطراف الثالثة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٥-ليس لدينا سيطرة على سلوك المستخدمين الآخرين لنظام<span dir=\"LTR\"> EJARLY </span>أو حقيقة أو دقة المعلومات التي قد ينشرها المستخدم على نظام<span dir=\"LTR\"> EJARLY. </span>لا يمكننا ضمان الهوية الحقيقية لأي فرد. أنت مسؤول عن تحديد هوية وملاءمة أي شخص أو كيان قد تتصل به من خلال المنصة. نحن لا نؤيد أي أشخاص يستخدمون أو يسجلون في خدماتنا. ومع ذلك ، فإننا نحتفظ بالحق (لكننا لسنا ملزمين) بالتحقق من هوية المستخدمين بالإضافة إلى توافر وملاءمة العناصر المدرجة للإيجار من قبل المقرضين. نحن لسنا مسؤولين عن أي معلومات خاطئة أو مضللة على الموقع أو النظام الأساسي ولن نكون مسؤولين عن أي أضرار من أي نوع ناتجة عن استخدامك للمنصة أو المعلومات المقدمة على المنصة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٦-استخدام أي عناصر مستأجرة من خلال نظام<span dir=\"LTR\"> EJARLY </span>هو على مسؤوليتك الخاصة. أنت وحدك المسؤول عن ضمان أن لديك ما يكفي من المعرفة والتدريب والمهارات والقدرات لاستخدام أي عنصر ، بما في ذلك الحصول على ومراجعة تعليمات الشركة المصنعة وأدلة التعامل الآمن. لن نكون مسؤولين عن أي إصابات أو خسائر أو أضرار (بما في ذلك الأضرار التي تلحق بالأفراد أو الممتلكات الشخصية أو الوفاة) الناشئة عن استخدام أي عنصر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٧-إن زيارة أو استخدام أي رابط تابع لطرف ثالث من نظام<span dir=\"LTR\"> EJARLY </span>هو على مسؤوليتك الخاصة. نحن نخلي مسؤوليتنا فيما يتعلق بالأفعال أو الإغفالات أو الأخطاء أو الإقرارات أو الضمانات أو الانتهاكات أو الإهمال أو عن أي إصابات شخصية أو وفاة أو تلف في الممتلكات أو أضرار أو نفقات أخرى ناتجة عن تفاعلاتك مع أطراف ثالثة عبر نظام<span dir=\"LTR\"> EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٨-نحتفظ بشكل صريح بالحق في تصحيح أي أخطاء في التوفر والتسعير على نظام<span dir=\"LTR\"> EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٩-إلى أقصى حد يسمح به القانون ، لا نتحمل نحن ومرخصونا أي التزام أو مسؤولية تجاهك أو تجاه أي شخص آخر عن أي خسارة تتكبدها فيما يتعلق بما يلي<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.١-عدم توفر نظام<span dir=\"LTR\"> EJARLY (</span>كليًا أو جزئيًا) أو بطئ أدائه ؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٢-أي خطأ أو إغفال في أي معلومات يتم توفيرها من خلال نظام<span dir=\"LTR\"> EJARLY </span>؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٣- أي تعرض للفيروسات أو أي أشكال أخرى من التداخل التي قد تلحق الضرر بنظام الكمبيوتر الخاص بك أو تعرضك للاحتيال عند الوصول إلى نظام<span dir=\"LTR\"> EJARLY </span>أو استخدامه. لتجنب الشك ، فأنت مسؤول عن ضمان العملية التي يمكنك من خلالها الوصول إلى واستخدام نظام<span dir=\"LTR\"> EJARLY </span>؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٤- أي موقع مرتبط من نظام <span dir=\"LTR\">EJARLY</span>. أي رابط على نظام <span dir=\"LTR\">EJARLY</span> إلى مواقع أخرى لا يعني أي تأييد أو تطبيق</p>\r\n\r\n<p dir=\"RTL\"><strong>١١- حقوق الملكية الفكرية</strong></p>\r\n\r\n<p dir=\"RTL\">١١.١- أنت تقر بأن جميع حقوق الملكية الفكرية (بما في ذلك ، على سبيل المثال لا الحصر ، حسن النية وحقوق النشر) في تطبيق<span dir=\"LTR\"> EJARLY </span>واسم وشعار<span dir=\"LTR\"> EJARLY </span>وأي علامات تجارية ونظام <span dir=\"LTR\">EJARLY </span>وأي تقنية أخرى ذات صلة هي ملكنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١١.٢- أنت تقر بأن الحقوق في تطبيق <span dir=\"LTR\">EJARLY </span>مرخصة (غير مباعة) لك ، وأنه ليس لديك حقوق في ، أو في ، في تطبيق <span dir=\"LTR\">EJARLY </span>وفي نظام <span dir=\"LTR\">EJARLY </span>بخلاف الحق في استخدام كل منها وفقًا مع شروط هذه الاتفاقية.</p>\r\n\r\n<p dir=\"RTL\"><strong>١١.٣-</strong> أنت تقر وتوافق على أن <strong><span dir=\"LTR\">ejarly&nbsp; </span></strong>، أو المرخصين التابعين لها ، يمتلكون جميع الحقوق والملكية والمصلحة في الخدمة ، بما في ذلك جميع حقوق الملكية الفكرية والملكية الصناعية وحقوق الملكية المعترف بها في أي مكان في العالم وفي أي قت بأن الخدمة قد تحتوي على معلومات حددتها <strong><span dir=\"LTR\">ejarly </span></strong>كمعلومات سرية وتوافق على عدم الكشف عن هذه المعلومات دون الحصول على موافقة كتابية مسبقة من <strong><span dir=\"LTR\">ejarly</span></strong>.</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">المحتوى الخاص&nbsp; بك. قد تكون بعض المحتويات التي تشاركها أو تحمّلها ، مثل الصور ، محمية بموجب قوانين الملكية الفكرية. يُقصد بمصطلح &quot;المحتوى&quot; النصوص والصور والصور والصوت والفيديو والرسائل وجميع أشكال البيانات أو الاتصالات الأخرى التي ترسلها أو ترسلها إلى الخدمة أو من خلالها أو فيما يتعلق بها.</li>\r\n	<li dir=\"RTL\">المسؤولية عن المحتوى الخاص بك. أنت وحدك المسؤول عن المحتوى الخاص بك ، وبمجرد نشره على<strong><span dir=\"LTR\">Ejarly</span></strong> ، لا يمكن دائمًا سحبه. أنت تتحمل جميع المخاطر المرتبطة بالمحتوى الخاص بك ، بما في ذلك اعتماد أي شخص على جودته أو دقته أو موثوقيته وأي مخاطر مرتبطة بالمعلومات الشخصية التي تكشف عنها. أنت تقر بأنك تمتلك أو لديك الأذونات اللازمة لاستخدام المحتوى الخاص بك وترخيص استخدامه كما هو موضح هنا. لا يجوز لك الإيحاء بأن المحتوى الخاص بك يتم برعاية أو إقراره بأي شكل من الأشكال بواسطة <strong><span dir=\"LTR\">ejarly</span></strong>. قد تعرض نفسك للمسؤولية إذا كان المحتوى الخاص بك ، على سبيل المثال ، يحتوي على مادة خاطئة أو مضللة عن قصد أو تشهيرية ؛ ينتهك أي حق لطرف ثالث ، بما في ذلك أي حقوق نشر أو علامة تجارية أو علامة خدمة أو براءة اختراع أو سر تجاري أو حق أخلاقي أو حق الخصوصية أو حق الدعاية أو أي ملكية فكرية أو حقوق ملكية أخرى ؛ يحتوي على مواد غير قانونية ، بما في ذلك الكلام الذي يحض على الكراهية أو المواد الإباحية ؛ يستغل القاصرين أو يضر بهم بطريقة أخرى ؛ ينتهك أو يدعو إلى انتهاك أي قانون أو لائحة ؛ أو ينتهك هذه الشروط.</li>\r\n	<li dir=\"RTL\">حقنا في استخدام المحتوى الخاص بك. يجوز لنا استخدام المحتوى الخاص بك بعدة طرق مختلفة ، بما في ذلك عرضه علنًا ، وإعادة تنسيقه ، ودمجه في الإعلانات والأعمال الأخرى ، وإنشاء أعمال مشتقة منه ، والترويج له ، وتوزيعه ، والسماح للآخرين بفعل الشيء نفسه فيما يتعلق مع مواقعهم الإلكترونية ومنصاتهم الإعلامية (&quot;الوسائط الأخرى&quot;). على هذا النحو ، فإنك تمنحنا بموجب هذا حقوقًا عالمية ودائمة وغير حصرية وخالية من حقوق الملكية وقابلة للتنازل وقابلة للترخيص من الباطن وقابلة للتحويل ، لاستخدام المحتوى الخاص بك لأي غرض. يرجى ملاحظة أنك تمنح مستخدمي الخدمة وأي وسائط أخرى بشكل نهائي الحق في الوصول إلى المحتوى الخاص بك فيما يتعلق باستخدامهم للخدمة وأي وسائط أخرى. أخيرًا ، أنت تتنازل بشكل نهائي ، وتتسبب في التنازل ، ضد<strong><span dir=\"LTR\">ejarly&nbsp; </span></strong>ومستخدميها عن أي مطالبات وتأكيدات على الحقوق المعنوية أو الإسناد فيما يتعلق بالمحتوى الخاص بك. نعني بكلمة &quot;استخدام&quot; الاستخدام والنسخ والأداء العلني والعرض وإعادة إنتاج وتوزيع وتعديل وترجمة وإزالة وتحليل وتسويق وإعداد أعمال مشتقة من المحتوى الخاص بك</li>\r\n	<li dir=\"RTL\">الملكية. بينك وبين <strong><span dir=\"LTR\">ejarly</span></strong> ، أنت تملك المحتوى الخاص بك. نحن نملك محتوى <strong><span dir=\"LTR\">ejarly</span></strong>، بما في ذلك على سبيل المثال لا الحصر الواجهات المرئية والميزات التفاعلية والرسومات والتصميم والتجميع (بما في ذلك ، على سبيل المثال لا الحصر ، اختيارنا وتنسيقنا وتجميعنا وترتيبه للمحتوى) ، ورمز الكمبيوتر ، والمنتجات ، البرامج وجميع العناصر والمكونات الأخرى للخدمة باستثناء المحتوى الخاص بك وأي محتوى تابع لجهة خارجية.</li>\r\n	<li dir=\"RTL\">أخرى. لا يعكس المحتوى بالضرورة رأي <strong><span dir=\"LTR\">ejarly</span></strong>. باستثناء ما يقتضيه القانون ، لسنا ملزمين بالاحتفاظ بنسخ من المحتوى الخاص بك أو تزويدك بها ، ولا نضمن أي سرية فيما يتعلق بالمحتوى الخاص بك. نحتفظ بالحق في إزالة المحتوى الخاص بك أو فحصه أو تعديله أو إعادة وضعه وفقًا لتقديرنا الخاص لأي سبب أو بدون سبب ، ودون إخطارك.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">١٢- <strong>الخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\">١٢.١- أنت توافق على قيامنا بجمع وتخزين والاحتفاظ باسمك والبريد الإلكتروني وكلمة المرور وتاريخ الميلاد ورقم الهاتف وتفاصيل الحساب المصرفي ومعلومات الجهاز ومعلومات الاستخدام داخل التطبيق (مثل إجابات الاستبيانات والردود التي تم النقر عليها والميزات المستخدمة) و معلومات الموقع. أنت توافق أيضًا على تزويدنا باسمك وتفاصيل الاتصال بالشرطة إذا اعتقدنا أنك قد سرقت أي عنصر مستأجر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٢.٢- أنت تقر بأنك قد قرأت وفهمت سياسة الخصوصية الخاصة بنا ، فيما يتعلق بجمع واستخدام معلوماتك الشخصية. بالموافقة على هذه الاتفاقية ، فإنك توافق أيضًا على المعلومات والموافقات والإفصاحات الواردة في سياسة الخصوصية الخاصة بنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣- <strong>عام</strong></p>\r\n\r\n<p dir=\"RTL\">١٣.١- إذا احتجنا إلى الاتصال بك ، فقد نقوم بذلك عن طريق البريد الإلكتروني أو الهاتف ، أو عن طريق نشر إشعار على نظام<span dir=\"LTR\"> EJARLY. </span>أنت توافق على أن هذا يفي بجميع المتطلبات القانونية فيما يتعلق بالاتصالات المكتوبة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٢- لن نكون مسؤولين أو مسؤولين عن أي فشل في أداء ، أو تأخير في أداء ، أي من التزاماتنا بموجب هذه الاتفاقية بسبب فعل أو حدث خارج عن سيطرتنا المعقولة ، بما في ذلك على سبيل المثال لا الحصر فشل شبكات الاتصالات العامة أو الخاصة أو فشل نظام<span dir=\"LTR\"> EJARLY</span> بسبب وصول طرف ثالث أو فشل النظام أو الجهاز أو خطأ المستخدم<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٣- بالنسبة لنا للتنازل عن حق بموجب هذه الاتفاقية ، يجب أن يكون التنازل كتابيًا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٤- يجوز لنا نقل حقوقنا والتزاماتنا بموجب هذه الاتفاقية إلى كيان آخر ، ومع ذلك ، لن يؤثر ذلك على حقوقك أو التزاماتنا بموجب هذه الاتفاقية</p>\r\n\r\n<p dir=\"RTL\">١٣.٥-البنود التي ، بطبيعتها ، تهدف إلى البقاء بعد إنهاء هذه الاتفاقية تظل سارية المفعول<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٦- إذا كان أي جزء أو حكم من هذه الاتفاقية غير قانوني أو غير قابل للتنفيذ أو غير صالح أو أصبح غير قانوني ، فسيتم تعديل هذا الجزء أو الحكم إلى الحد المطلوب لمعالجة عدم الشرعية أو عدم قابلية التنفيذ أو البطلان. إذا لم يكن التعديل ممكنًا ، فيجب التعامل مع الجزء أو الحكم لجميع الأغراض على أنه منفصل عن هذه الاتفاقية. ستكون بقية شروط هذه الاتفاقية ملزمة لك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٧-تحدد هذه الاتفاقية كل ما يتفق عليه الطرفان فيما يتعلق باستخدامك لنظام<span dir=\"LTR\"> EJARLY</span> أو استخدام خدمات<span dir=\"LTR\"> EJARLY</span> ويحل محل ويلغي أي شيء تمت مناقشته أو تبادله أو الاتفاق عليه قبل موافقتك على هذه الاتفاقية. أنت تقر بأنك لم تعتمد على أي تمثيل أو ضمان أو اتفاقية تتعلق بنظام<span dir=\"LTR\"> EJARLY</span> أو خدمات<span dir=\"LTR\"> EJARLY</span> غير المنصوص عليها صراحة في هذه الاتفاقية ، وليس لهذا التمثيل أو الضمان أو الاتفاقية أي تأثير من تاريخ موافقتك على هذه الاتفاقية<span dir=\"LTR\"> .</span></p>', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>السياسات والإجراءات والخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>شكرًا لك على استخدام&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>تاريخ آخر تعديل:&nbsp;<span dir=\"LTR\">04/08/2021</span></strong></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:center\"><strong>اتفاقية ترخيص المستخدم النهائي (الاتفاقية) هي اتفاقية قانونية بينك (أنت) ومؤسسة قوة لتقنية المعلومات (سجل تجاري رقم ٢٢٥١٤٩٨٩٠٦) المالكة لتطبيق&nbsp;<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>( نحن أو نحن) لاستخدام نظام تأجير وخدمات من شخص إلى شخص عبر موقع و تطبيق إيجارلي&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>١-كيف تنطبق هذه الشروط :</strong></p>\r\n\r\n<p dir=\"RTL\">١.١ -من خلال الوصول إلى او استخدام أي منتج او خدمة نقدمها من تطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;او الموقع الالكتروني واي تقنية اخرئ تابعة او ذات صلة بنظام&nbsp;<span dir=\"LTR\">EJARLY ,</span>&nbsp;والامتثال لهذه الشروط التي تنطبق على جميع المستخدمين والزوار وغيرهم ممن يصلون إلى خدمة&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;فإنك توافق على الامتثال والالتزام بشروط الخدمة هذه (&quot;الشروط&quot;). عندما تُدرج المنتجات والخدمات للإيجار بصفتك &quot;مالكًا&quot; ، فإنك توافق على الامتثال لقواعد المالكين ، وعندما تستأجر منتجات وخدمات من مالك بصفتك &quot;مستأجرًا&quot; ، فإنك توافق على الامتثال لقواعد المستأجرين . إذا كنت لا توافق على أي من سياسة الاجراءات وشروط الاستخدام و الخصوصية ،، فلا يحق لك الوصول الي الخدمة واستخدام تطبيق او موقع&nbsp;<span dir=\"LTR\">EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.2 -يجب قراءة هذه الاتفاقية بالاقتران مع سياسة الخصوصية الخاصة بنا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.3 -تحديثات<span dir=\"LTR\">. EJARLY&nbsp;</span>&nbsp;قد تقوم بتحديث شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه في أي وقت ، وسوف تقوم&nbsp;<span dir=\"LTR\">EJARLY&nbsp;&nbsp;</span>&nbsp;بنشر النسخة المحدثة من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه على الموقع. أنت تدرك وتوافق على أنه سيتم اعتبارك موافقًا على شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة إذا كنت تستخدم الخدمة بعد نشر شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة أنت مسؤول عن مراجعة أحدث إصدار من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; . إذا كنت لا توافق في أي وقت على أي جزء من شروط الاستخدام والسياسات والإجراءات والخصوصية &nbsp;هذه ، فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٢-</strong>&nbsp;<strong>وصف خدمات</strong><span dir=\"LTR\">&nbsp; &nbsp;&nbsp;&nbsp;Ejarly</span>&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>٢.١&nbsp;</strong>&nbsp;<strong>-</strong>&nbsp;إيجارلي&nbsp;<strong><span dir=\"LTR\">(Ejarly)</span></strong>&nbsp;هي منصة تأجير تتيح لأفراد المجتمع مشاركة ممتلكاتهم لبعضهم البعض ، نمكن أصحاب الممتلكات (المؤجرون ) الاستفادة من ممتلكاتهم المركونة والغير مستغلة من كسب المال منها من خلال تأجيرها لأفراد أخرون (المستأجرين )، نقوم بربطهم بالأفراد الذين يحتاجون (المستأجرين )&nbsp; الى أشياء لاستخدام قصير الاجل أو للاستخدام الفردي واستئجارها وتوفير المال . تقوم المنصة على ربط و تسهيل التواصل لعملية التأجير بين الطرفين في بيئة أمنة وموثوقة&nbsp; قدر المستطاع&nbsp;&nbsp;&nbsp; .</p>\r\n\r\n<p dir=\"RTL\">إجارلي<strong><span dir=\"LTR\">&nbsp;(Ejarly)&nbsp;&nbsp;</span></strong>ليست سوى وسيط لأي معاملة بين المالكين والمستأجرين لتأجير العناصر والخدمات على منصة إجارلي&nbsp;<strong><span dir=\"LTR\">( Ejarly)&nbsp;</span></strong>عندما يؤجر المالك منتجًا أو خدمة للمستأجر ، فإنهم يبرمون عقدًا مع بعضهم البعض مباشرة ، وليس مع&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>، لا يمكن اعتبار &nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>مسؤولة ، وإلى أقصى حد يسمح به القانون ، تستبعد المسؤولية عن سلوك استخدامات&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">سوف تساعد&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;في تسهيل حل النزاعات. لا يمكن أن تضمن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;حقيقة أو دقة أو سلامة أو وجود أو شرعية أي منتج أو خدمة مدرجة للإيجار. التحقق من الهوية ليس مصادقة على منتجات المالك أو مصادقة على المستأجر. لا تصادق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;أو تضمن منتجات للإيجار على المنصة. يجب على العملاء توخي الحرص عند استئجار منتج أو خدمات على&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">إذا لم يمتثل المالك أو المستأجر لشروط الخدمة ، يحق لـ&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;إزالة القوائم و / أو إلغاء أي معاملات&nbsp;<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣- وصف المستخدمين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١- &nbsp;الملاك ( المؤجرون )</strong></p>\r\n\r\n<p dir=\"RTL\">مالكين المنتجات&nbsp; الإعلان عن سلع او خدمات للإيجار داخل&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب&nbsp; الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة&nbsp; (&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.١-</strong>&nbsp;بصفتك مالكًا ، عندما تقوم &nbsp;بتأجير عنصر أو تقديم خدمة للمستأجر ، فإنك تتعهد بالامتثال لقواعد وشروط الخدمة الخاصة بالمالكين ، وتقر بأنك تدخل في عقد مباشر مع المستأجر وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong>،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٢-</strong>&nbsp;بصفتك مالكًا ، فإنك تقر بأن المستأجر لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المستأجر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٣</strong>&nbsp;-بصفتك مالكًا ، فإنك توافق على الامتثال لقواعد المالكين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المالكين وستكون مسؤولاً عن أي تعويض للمقترض فيما يتعلق بأي عدم امتثال. يتضمن ذلك التأكد من مطابقة المنتج المدرج للإيجار مع الوصف الموجود على المنصة. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.١.٤ -</strong>&nbsp;أي تعويض للمستأجر عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٥ -</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢- المستأجرين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١-&nbsp;&nbsp;</strong>المستأجرين من يقومون باستئجار منتجات من المالك واستخدامها لوقت مدد بينهم ومن ثم ارجاعة للمالك ، أنت كمستأجر توافق على أنه عند استئجار عنصر او خدمة من مالك في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;، فإنك توافق على الامتثال لقواعد المستأجرين وشروط الخدمة، وتقر بأنك تدخل في عقد مباشر مع المالك وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٢-</strong>&nbsp;بصفتك مستأجرًا ، فإنك تقر بأن المالك لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المالك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٣-</strong>&nbsp;بصفتك المستأجر ، فإنك توافق على الامتثال لقواعد المستأجرين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المستأجرين وستكون مسؤولاً عن أي تعويض للمالك فيما يتعلق بأي عدم امتثال. يتضمن ذلك فقدان أو تلف المنتج الذي استأجرته. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;</span></strong>ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٤-</strong>&nbsp;أي تعويض للمالك عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٥-</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٦-</strong>&nbsp;بصفتك المستأجر أنت تقر وتضمن أنك على دراية بنوع المنتج الذي يتم تأجيره والتعديلات المطلوبة للتشغيل الآمن للمنتج واستخدامه ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٧-</strong>&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٨-</strong>&nbsp;أنت مسؤول مسؤولية كاملة عن سلامتك وسلامة أي طرف ثالث أثناء استخدام المنتج ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩-</strong>&nbsp;<strong>سوف :</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.١-</strong>&nbsp;تعامل المنتج بنفس درجة العناية على الأقل كما لو كانت ملكيتك الخاصة ، وعلى أي حال مع العناية المعقولة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.٢-</strong>&nbsp;إعادة المنتج إلى المُقرض بنفس الحالة التي تلقيتها ذلك في التاريخ والوقت المستحق وفي المكان المحدد في القائمة المقبولة</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.٣-&nbsp;</strong>أنت تدرك أنه ستكون هناك رسوم إضافية إذا تم إرجاع المنتج في وقت أو تاريخ أو موقع مختلف عما هو مذكور في القائمة المقبولة ، بما في ذلك الرسوم المتأخرة أو رسوم الإيجار الإضافية ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠-</strong>&nbsp;<strong>ستضمن أن المنتج:</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.١-</strong>ستضمن أن المنتج&nbsp; يظل ملكية شخصية ولا يصبح عنصرًا أساسيًا في الممتلكات العقارية ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.٢-</strong>ستضمن أن المنتج يتم الاحتفاظ به خاليًا من أي امتيازات أو أعباء ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠.٣-</strong>ستضمن أن المنتج يتم تخزينه في مكان وبيئة آمنة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١-</strong>تقر بأن المُقرض قد يستعيد ملكية المنتج في أي وقت دون إخطارك مسبقًا إذا:</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.١-</strong>&nbsp;تم استخدام المنتج بشكل ينتهك القانون ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٢-</strong>&nbsp;يبدو أنه قد تم التخلي عن المنتج ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣٣.٢.١١.٣-</strong>&nbsp;المنتج تُستخدم في انتهاك لاتفاقية التأجير ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١١.٤-</strong>&nbsp;أنك قدمت تحريفًا للمقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٥-</strong>&nbsp;فشلت في إعادة المنتج عند استحقاقه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٢-&nbsp;</strong>ستدفع للمالك ما يصل إلى قيمة الاستبدال الكاملة للمنتج مقابل جميع الخسائر و / أو الأضرار التي تلحق بالمنتج ، باستثناء حالات التآكل والتلف العادية فقط ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٣-&nbsp;</strong>تقر بأن المنتج يظل ملكية حصرية للمقرض ويخضع للفحص من قبل المُقرض في أي وقت بناءً على طلب المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٤-&nbsp;</strong>أنت تدرك وتقر بأن المنتج مقدم من قبل المُقرض &quot;كما هو&quot; وأن المُقرض لا يقدم أي ضمانات بخلاف تلك المنصوص عليها صراحةً في القسم) &nbsp;أعلاه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٥-&nbsp;</strong><strong>لن تقوم&nbsp;</strong><strong>:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.١-&nbsp;</strong>بإزالة أي ملصقات من المنتج تحدد المُقرض على أنه المالك ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.٢-</strong>&nbsp;تعديل المنتج بأي طريقة دون الحصول على موافقة كتابية مسبقة من المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٤- حسابك الخاص في إجارلي:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١-&nbsp;</strong>&nbsp;من أجل الوصول إلى نظام إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly)&nbsp;</span></strong>&nbsp;والحصول على خدمات &nbsp;إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly) &nbsp;</span></strong>، يجب عليك إنشاء حساب مستخدام :</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.١-&nbsp;</strong>&nbsp;عنوان بريدك الإلكتروني (الحساب)</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٢-&nbsp;</strong>&nbsp;رقم جوالك</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٣-&nbsp;</strong>&nbsp;وبيانات الهوية الوطنية</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٤-&nbsp;</strong>&nbsp;اسم مستخدم</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٥-&nbsp;</strong>&nbsp;وستحتاج إلى إنشاء كلمة مرور لحسابك - نحن نشجعك على استخدام كلمات مرور &quot;قوية&quot;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;(كلمات مرور تستخدم مزيجًا من الأحرف الكبيرة والصغيرة والأرقام والرموز) مع حسابك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢-&nbsp;</strong>&nbsp;&nbsp;يجب أن تبلغ من العمر السن القانوني فوق١٨ سنه ليتيح لك عرض ممتلكاتك او خدمات والتعامل والتأجير من المالك للدخول في اتفاقية ملزمة قانونًا لاستخدام نظام&nbsp;<strong><span dir=\"LTR\">ejarly.&nbsp;</span></strong>إذا كان عمرك أقل من العمر المسموح فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢-&nbsp;</strong>&nbsp;&nbsp;تقع على عاتقك مسؤولية الحفاظ على سرية تفاصيل تسجيل الدخول الخاصة بك وأي أنشطة تحدث ضمن حسابك. إذا كانت لديك أي مخاوف بشأن إساءة استخدام حسابك ، فيجب عليك التواصل بنا على&nbsp;<strong><span dir=\"LTR\">info@ejarly.net&nbsp;</span></strong>&nbsp;على الفور لإعلامنا<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٣-</strong>&nbsp;أنت مسؤول عن الحفاظ على سرية كلمة المرور لحسابك وستكون مسؤولاً عن جميع المستخدمين من خلال تسجيلك و / أو تسجيل الدخول ، سواء أكان ذلك مصرحًا به أم غير مصرح به. أنت توافق على إخطارنا فورًا بأي استخدام غير مصرح به للتسجيل أو الحساب أو معلومات الفواتير أو كلمة المرور الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\"><strong>٥-<span dir=\"LTR\">.&nbsp;</span>كيفية استخدام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;:</strong></p>\r\n\r\n<p dir=\"RTL\">بعد إتمام عملية التسجيل من قبل المالك والمستأجر وتوثيق الحساب :</p>\r\n\r\n<p dir=\"RTL\">٥.١- يقوم المؤجرون بإضافة او اعلان ممتلكاته من منتجات وخدمات للتأجير في تطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;بشرط مطابق للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٥.٢- ويقوم المستأجر بتصفح التطبيق لتأجير منتجات وخدمات او طلب منتجات وخدمات من المالك</p>\r\n\r\n<p dir=\"RTL\">٥.٣- طلب تأجير : يمكن للمستأجرين طلب حجز العناصر التي يوفرها المقرضون عن طريق تقديم طلب إلى المُقرض من خلال نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;وإدراج تاريخ بدء الحجز المطلوب وتاريخ اكتمال الحجز وتفاصيل الطلب وإرساله للمالك ،</p>\r\n\r\n<p dir=\"RTL\">٥.٤- الموافقة : سيقوم نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;بإخطار المالك بالطلب المرفوع من المستأجر ويحق للمالك القبول او رفض الطلب مع ذكر السبب وفي حال تم قبول الطلب سوف يقوم النظام بتأكيد الطلب وفتح عملية تأجير موثقة داخل&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;و إبلاغ المستأجر بقبول المالك للطلب ، وتنبيه الطرفين بالتواصل داخل التطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;لتحديد مكان وموعد الاتقاء واكمال العملية ،</p>\r\n\r\n<p dir=\"RTL\">٥.٥- المعاينة : في تاريخ بدء الحجز ، يجب أن يكون كل المالك المستأجر في الموقع المتفق عليه وننصح بإتباع إرشادات السلامة وقت المعاينة حتى يقوم المالك بتسليم العنصر المؤجر إلى المستأجر، المستآجرون مسؤولون ومسؤولون عن العنصر المستأجر خلال فترة الحجز ويجب أن يتعاملوا مع العنصر المستأجر بعناية واحترام. إذا كنت مقترضًا ، فستكون مسؤولاً عن تغطية تكاليف التلف أو استبدال أي أضرار أو خسارة للعنصر المستأجر أثناء الحجز ، بالإضافة إلى أي أضرار مرتبطة بعدم إعادة العنصر المستأجر في تاريخ اكتمال الحجز و إلى الموقع المحدد<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">٥.٥.١- &nbsp;يقوم المالك بمقابلة المستأجر لتسليم المنتج للمستأجر وشرح آلية عمل المنتج وتوثيق المنتج قبل تسليمه للمستأجر عن طريق تصويره بحالته وهوا يعمل ومن ثم إتمام المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٥.٢- يقوم المستأجر بمعاينة المنتج المراد تأجيره والتأكد منه وتوثيق المنتج عن طريق تصويره بحالته قبل الاستلام ومن ثم تأكيد المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٦- الدفع : بعد إتمام مرحله المعاينه يتم دفع مبلغ التأجير من المستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٦.١- يقوم المستأجر بدفع مبلغ التأجير للمالك عن طريق وسائل الدفع المتاحه لدئ&nbsp;<span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧-الاستلام: بعد إتمام مرحله الدفع يجب علئ آلمالك تسليم المنتج للمستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٧.١-يقوم المالك بتسليم المنتج للمستأجر وتأكيد التسليم عن طريق التطبيق<span dir=\"LTR\">&nbsp;EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧.٢ -يقوم المستأجر بعد استلام المنتج من المالك يقوم المستأجر بتأكيد استلام المنتج عن طريق التطبيق&nbsp;<span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٨-الاسترجاع : عند العودة إلى المالك في الموقع المحدد</p>\r\n\r\n<p dir=\"RTL\">٥.٨.١-المالك&nbsp; سيفحص المالك السلعة المؤجرة للتأكد من أنها في نفس الحالة التي كانت عليها عندما تم تسليمها إلى المستأجر. بعد الفحص ، قد يتم فرض رسوم التنظيف على المستأجر اعتمادًا على حالة العنصر المستأجر وتأكيد استرجاع المنتج .</p>\r\n\r\n<p dir=\"RTL\">٥.٨.٢-يقوم المستأجر بتسليم المنتج للمالك وتمام استرجاع المنتج ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٥.٩- التقييم : يقوم كلا الطرفين بتقييم عملية التأجير</p>\r\n\r\n<p dir=\"RTL\"><strong>٦- يسمح نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;&nbsp;بما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong>&nbsp;&nbsp;<strong>المؤجرون</strong>&nbsp;: &nbsp;مالكين المنتجات &nbsp;الإعلان عن سلع او خدمات للإيجار داخل&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب &nbsp;الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة &nbsp;(&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong>&nbsp;&nbsp;أنت تقر وتضمن أنك</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.١-</strong>&nbsp;&nbsp;&nbsp;أنت المالك الوحيد للمنتج أو أن لديك وكالة كاملة أو سلطة أخرى لتقديم المنتج إلى المستأجر ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٢-</strong>&nbsp;&nbsp;&nbsp;&nbsp;تم وصف المنتج بدقة في قائمة عرض المنتج ، بما في ذلك الحالة الحالية وأي أخطاء أو عيوب أو مشاكل معروفة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٣-</strong>&nbsp;&nbsp;&nbsp;&nbsp;باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة &nbsp;&nbsp;&nbsp;الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٤-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٥-</strong>&nbsp;&nbsp;&nbsp;&nbsp;يجب ألا تعرض خدمة او منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٦-</strong>&nbsp;&nbsp;&nbsp;&nbsp;عدم تبادل بيانات التواصل مع المستآجر ويتم التواصل مع المستأجر فقط عن طريق الرسائل داخل التطبيق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمستأجر للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٧-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لا يتم تسليم أي عنصر إلا للمقترض بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٨-</strong>&nbsp;&nbsp;&nbsp;&nbsp;يجب عليك فقط تسليم العنصر إلى الشخص المستآجر المستخدم في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;<strong>٦.١.٩-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١٠-</strong>&nbsp;يمكنك إزالة المنتج أو إلغاء اتفاقيتك لإقراض عنصر للمقترض في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار. إذا قمت بإلغاء اتفاقية استئجار عنصر لمستأجر قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي&nbsp;<strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١١-</strong>&nbsp;&nbsp;&nbsp;بصفتك مالكآ (مؤجر) ، فأنت وحدك المسؤول عن تكلفة أي إصلاحات أو تعديلات على المنتج لم تكن ضرورية بسبب الضرر الناجم عن المستأجر او وجود عيوب لم يتم وصفها أو تصويرها في القائمة المنشورة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢-</strong>&nbsp;&nbsp;&nbsp;<strong>بالمستأجر&nbsp;</strong>&nbsp;: عندما توافق على استئجار عنصر مع المالك ، يمنحك المالك حقًا محدودًا لاستخدام هذا العنصر خلال فترة الاستئجار ذات الصلة. هذا الحق شخصي لك ولا يُسمح لك بمنح هذا الحق لأي شخص آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;أنت مسؤول عن ضمان ما يلي<strong><span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong>&nbsp;أنك تمتثل لجميع القوانين المعمول بها عند استخدام العنصر ؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>٦.٢.٢-</strong>فإنك تقر أنك ستكون قادرًا على دفع الإيجار ولديك أموال لسداد ثمن العناصر المفقودة أو التالفة. قد تتطلب<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>إيداعًا منك&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; يصل إلى القيمة المقدرة (المحددة من قبل المقرض) للبند المستأجر المقترض وتوافق على أنه يمكننا خصم القيمة المقدرة من حسابك او المحفظه في حالة تلف العنصر أو الإخفاق في إرجاع العنصر. بحلول تاريخ العودة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">تاريخ العودة ورسوم</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٣-</strong>&nbsp;أنت توافق على أنه إذا تم إرجاع عنصر ما بعد تاريخ الإرجاع (التاريخ والوقت المتفق عليه لإرجاع عنصر) ، فسيتم فرض رسوم تصل إلى&nbsp;<strong><span dir=\"LTR\">5&nbsp;</span></strong>اضعاف قيمة الإيجار لكل يوم إضافي على تاريخ الإرجاع وتوافق على خصم هذا المبلغ من حسابك الحساب<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٤-</strong>&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٥-</strong>&nbsp;يجب ألا تعرض طلب منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٦-</strong>عدم تبادل بيانات التواصل مع المالك ويتم التواصل مع المالك فقط عن طريق الرسائل داخل التطبيق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمالك للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٧-</strong>&nbsp;لا يتم تسليم أي عنصر إلا للمالك بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٨-</strong>&nbsp;يجب عليك فقط ارجاع المنتج إلى الشخص المالك المستخدم في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٩-</strong>&nbsp;لك مطلق الحرية في الغاء عملية التأجير في حال المنتج مخالف او مختلف عن المعروض في منصات&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٠-</strong>&nbsp;ستكون مسؤولاً عن أي خسارة أو تلف للعنصر الذي استأجرته. يرجى الاطلاع على الفقرة المعلومات حول كيفية تعاملنا مع الخلافات بين المقترضين والمقرضين ، بما في ذلك أي نزاعات في حالة تلف العنصر أو فقده أو سرقته<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١١-</strong>&nbsp;يمكنك إلغاء طلب تأجير المنتج في أي وقت قبل قبول المقرض للطلب او في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار ، إذا قمت بإلغاء اتفاقية استئجار عنصر المالك قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي&nbsp;<strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٢-</strong>لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٣-</strong>&nbsp;أنك تمتثل لأية توجيهات معقولة يقدمها المُقرض من أجل استخدام العنصر بأمان ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٤-</strong>&nbsp;باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة&nbsp;&nbsp;&nbsp; الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٥-</strong>&nbsp;إذا أخفقت في إرجاع عنصر بحلول الموعد النهائي المتفق عليه ، فيجب عليك الاتصال بالمُقرض و / أو&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;لإعلامهم بمجرد علمك بأنك ستفوت الموعد النهائي. ستحتاج أيضًا إلى الحجز والدفع مقابل الوقت الممتد على الفور. قد لا يكون المُقرض قادرًا على استيعاب التمديد وفي هذه الحالة تقع على عاتقك مسؤولية إعادة العنصر (العناصر) إلى المُقرض خلال إطار زمني يناسب المُقرض. إذا لم تقم بذلك ، فستكون مسؤولاً عن دفع الرسوم المتأخرة ، والتي ستكون وتصل الى&nbsp;<strong><span dir=\"LTR\">5</span></strong>اضعاف رسوم الإيجار عن الفترة التي تأخر فيها العنصر (&quot;الرسوم المتأخرة&quot;). أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;يمكنها خصم هذا المبلغ من بطاقتك أو حسابك المصرفي دون إذن آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٧- رسوم الحجز وشروط الدفع</strong></p>\r\n\r\n<p dir=\"RTL\">٧.١ - لا توجد رسوم لإنشاء حساب. ومع ذلك ، فإننا نفرض رسومًا على كل معاملة تتم من خلال نظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span><span dir=\"LTR\">&nbsp;(</span>رسوم المعاملات). على وجه الخصوص ، نحن نفرض رسومًا على<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٧.٢ - &nbsp;رسوم على كل عملية مكتملة ، عمولة&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;&nbsp;تصل الى (<span dir=\"LTR\">15</span>٪) وهي الرسوم التي يتم عرضها للمالكين بعد انتهاء عملية التأجير ويحق لـ&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>تغيرها بدون اخطار مسبق للمستخدمين ويجب على المستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٣ - &nbsp;رسوم الخدمة سوق يتم احتساب رسوم للخدمه من المستأجرين لكل عمليه تأجير مكتمله تقدر بقيمه تصل الى ٥ ريال ويحق لـ&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>تغيرها بدون اخطار مسبق للمستخدمين ويجب علئ آلمستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٤ - &nbsp;رسوم تمميز المنتج :تمميز المنتج خدمة تقدمها&nbsp;<span dir=\"LTR\">EJARLY</span>للاعلان عن المنتجات لزياده فرصه استأجارها من المستأجرين وتقون بقيمه رمزيه تحدد في الإعلان</p>\r\n\r\n<p dir=\"RTL\"><strong>٧.١ -&nbsp;</strong>&nbsp;<strong>الضريبة :</strong>&nbsp;المالك اوالمستأجر تقر بأنك المسؤول الوحيد عن دفع الضرائب المطبقة (إن وجدت) المستحقة عليك وفقًا لاستخدامك&nbsp; أنت وحدك المسؤول عن جميع الالتزامات الضريبية المرتبطة بمعاملة التأجير الخاصة بك. &quot;الضريبة&quot; تعني أي ضرائب القيمة المضافة (<strong><span dir=\"LTR\">VAT</span></strong>) أو أي ضرائب أخرى قد يُطلب من المُقرض أو المستأجر تحصيلها و / أو تحويل إلى أي وكالات حكومية (&quot;السلطات الضريبية&quot;). تختلف القوانين في الولايات القضائية المختلفة.&nbsp;<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>لا يمكنها ولا تقدم نصائح متعلقة بالضرائب لأي مقرضين . يرجى استشارة مستشارك الضريبي لتحديد المعاملة الضريبية لأنشطتك في الخدمة أنت توافق على تعويض&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>، ومسؤوليها ، ومديريها ، وموظفيها ، والشركات التابعة لها ، والشركات التابعة لها ، والوكلاء ، والخلفاء والمتنازل لهم من وضد أي التزامات أو أضرار أو خسائر أو تكاليف أو مصاريف أو رسوم تسوية (بما في ذلك المحامين المعقولون &#39;&#39; ، والدفاع عنها وحمايتها. الرسوم وتكاليف الدفاع ومصاريف التحقيق وتكاليف الاكتشاف وتكاليف المحكمة) الناشئة عن خرقك لهذا القسم</p>\r\n\r\n<p dir=\"RTL\"><strong>٨- الأمن</strong></p>\r\n\r\n<p dir=\"RTL\">أمن الحساب. الحفاظ على أمان الحساب أمر في غاية الأهمية. أنت وحدك المسؤول عن الحفاظ على سرية كلمة مرور حسابك. أنت توافق على إخطار<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>على الفور إذا علمت بأي استخدام غير مصرح به لكلمة المرور الخاصة بك أو لحسابك تهتم ِ<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;بسلامة وأمن معلوماتك الشخصية. ومع ذلك ، لا يمكننا أن نضمن أن الأطراف الخارجية غير المصرح لها لن تكون قادرة أبدًا على هزيمة إجراءاتنا الأمنية أو استخدام معلوماتك الشخصية لأغراض غير لائقة. أنت تقر بأنك تقدم معلوماتك الشخصية على مسؤوليتك الخاصة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٩- المسؤولية:</strong>&nbsp;<strong>التفاعلات والنزاعات بين المالك والمستأجر</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">أنت توافق على أنه عندما تؤجر أو تستأجر منتج او خدمة او طلب منتج او خدمة من&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>، فإن معاملة التأجير تكون فقط بينك وبين المالك و / أو المستآجر ، كما هو معمول به ، وأن<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>ليس طرفًا في عملية التأجير. لدى<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>الحق ، وليس الالتزام ، في مراقبة أي نزاع و / أو مساعدته و / أو حله بين المؤجر والمستأجر - بما في ذلك على سبيل المثال وليس الحصر ، من خلال فرض القيمة التقديرية الكاملة للالتزام الحدث الذي تقرر فيه أن المقترض قد سرق أو فقد أو دمر عناصر المالك<strong><span dir=\"LTR\">.</span></strong>في حالة عدم تمكن المالك والمستأجر من حل نزاع بينهما مباشرة ، فقد يطلبان من&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;التوسط في النزاع. قد تقبل&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>أو ترفض مثل هذا الطلب لتكون وسيطًا وفقًا لتقديرها الخاص. إذا قبلت&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;طلب العمل كوسيط ، فيجوز لها فرض رسوم من أي مبالغ تحدد&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>أنها مستحقة الدفع من قبل المستأجر لتعويض المالك عن أي خسارة أو ضرر يلحق بالمالك. العنصر. سنقوم بتحميل هذا المبلغ على المستأجر بالإضافة إلى أي مبالغ يطلب من المستأجر دفعها للمالك ، والتي قد تشمل الرسوم المنسوبة إلى تلك الأيام التي لم يتمكن فيها المالك من إقراض السلع إلى مستأجرين آخرين.</li>\r\n	<li dir=\"RTL\">&nbsp;في غضون إطار زمني معين بعد إكمال عملية التاجير ، يمكن للمؤجرين والمستآجرين ترك مراجعة عامة (&quot;مراجعة&quot;) وتقديم تصنيف نجمي (&quot;تصنيف&quot;) عن بعضهم البعض. تعكس التقييمات أو المراجعات آراء المستخدم الفردي ولا تعكس آراء&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>. لم يتم التحقق من التقييمات والمراجعات من قبل<strong><span dir=\"LTR\">&nbsp;ejarly&nbsp;</span></strong>للتأكد من دقتها وقد تكون غير صحيحة أو مضللة. يجب أن تكون التقييمات والمراجعات دقيقة ولا يجوز أن تحتوي على أي لغة مسيئة أو تشهيرية. يحظر على المستخدمين التلاعب بنظام التقييمات والمراجعات بأي طريقة ، مثل توجيه طرف ثالث لكتابة مراجعة إيجابية أو سلبية عن مستخدم آخر. تعد التقييمات والمراجعات جزءًا من الملف الشخصي العام للمستخدم ويمكن أيضًا أن تظهر في مكان آخر على خدمة<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>جنبًا إلى جنب مع المعلومات الأخرى ذات الصلة مثل عدد معاملات الإقراض وعدد عمليات الإلغاء ومتوسط ​​وقت الاستجابة وأي معلومات أخرى تعتبرها<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>ذات صلة<strong><span dir=\"LTR\">&nbsp;.</span></strong></li>\r\n	<li dir=\"RTL\">&nbsp;انت توافق ويحق لـ&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;بتقديم للطرف المتضرر بيانات المستخدم الاخر لتقديمها للجهات المختصة ، ولا يترتب على&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;او الشركة الام أي مسألة قانونية فأنت توافق بذألك</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">٩.٤- &nbsp;يتم تقديم خدمات<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>على أساس &quot;كما هي&quot;. نحن لا نقدم أي ضمانات ، صريحة أو ضمنية ، وننكر بموجب هذا جميع الضمانات الأخرى وننفيها بما في ذلك ، على سبيل المثال لا الحصر ، الضمانات الضمنية أو شروط القابلية للتسويق أو الاستخدام أو الملاءمة لغرض معين أو عدم التعدي على الملكية الفكرية أو أي انتهاك آخر للحقوق في فيما يتعلق باستخدامك لنظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>هذا يعني أننا غير قادرين على الوعد بأن استخدامك لنظام<span dir=\"LTR\">&nbsp;EJASRLY&nbsp;</span>لن ينقطع ، دون تأخير ، أو خالي من الأخطاء أو يلبي توقعاتك ، ولا نقدم أي التزام فيما يتعلق بأداء أو توفر نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>في هذه الاتفاقية و إلى الحد الذي نتمكن فيه من القيام بذلك ، فإننا نستبعد أي التزامات قد ينطوي عليها القانون<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>١٠ - كمستخدم لنظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>، فأنت تفهم وتوافق على ما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;١٠.١- لن نتحمل نحن أو الشركات التابعة لنا أي مسؤولية تجاهك أو تجاه الآخرين عن أي معاملات غير مصرح بها تتم باستخدام كلمة المرور الخاصة بك أو حسابك أو معلومات الفواتير الخاصة بك ؛ و</p>\r\n\r\n<p dir=\"RTL\">١٠.٢- قد يتسبب الاستخدام غير المصرح به لكلمة المرور الخاصة بك أو لحسابك أو معلومات الفواتير الخاصة بك في تحميلك المسؤولية تجاهنا نحن والمستخدمين الآخرين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٣-عندما تزودنا بمعلوماتك الشخصية ، يجمع نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هذه المعلومات وفقًا لسياسة الخصوصية الخاصة بنا. لن نتدخل نحن والشركات التابعة لنا في المعلومات بشكل تعسفي ، لكننا نحتفظ بالحق في إزالة المعلومات في بعض الظروف المخففة ، مثل عندما يكون لدينا سبب معقول للشك في أن المستخدم قد يكون احتياليًا أو مزيفًا. نحتفظ أيضًا بالحق في اتخاذ خطوات للتحقق من هويتك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٤- إذا تفاعلت مع نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>بأي طريقة أو أنشأت حسابًا ، فإنك تقوم بذلك على مسؤوليتك الخاصة وفهمك لهذه الاتفاقية. نحن لسنا ولن نكون مسؤولين عن أي إجراءات من قبل مستخدم آخر أو فرد أو شركة أو جمعية أو كيان أو مجموعة أخرى قد تضر بك جسديًا أو ماليًا أو لفظيًا أو رقميًا أو تضايقك بأي شكل من الأشكال. نحن نبذل جهودًا معقولة تجاريًا لتوفير مجتمع نزيه وآمن وجدير بالثقة ولكن لا يمكننا أن نكون مسؤولين عن تصرفات الأطراف الثالثة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٥-ليس لدينا سيطرة على سلوك المستخدمين الآخرين لنظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>أو حقيقة أو دقة المعلومات التي قد ينشرها المستخدم على نظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>لا يمكننا ضمان الهوية الحقيقية لأي فرد. أنت مسؤول عن تحديد هوية وملاءمة أي شخص أو كيان قد تتصل به من خلال المنصة. نحن لا نؤيد أي أشخاص يستخدمون أو يسجلون في خدماتنا. ومع ذلك ، فإننا نحتفظ بالحق (لكننا لسنا ملزمين) بالتحقق من هوية المستخدمين بالإضافة إلى توافر وملاءمة العناصر المدرجة للإيجار من قبل المقرضين. نحن لسنا مسؤولين عن أي معلومات خاطئة أو مضللة على الموقع أو النظام الأساسي ولن نكون مسؤولين عن أي أضرار من أي نوع ناتجة عن استخدامك للمنصة أو المعلومات المقدمة على المنصة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٦-استخدام أي عناصر مستأجرة من خلال نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هو على مسؤوليتك الخاصة. أنت وحدك المسؤول عن ضمان أن لديك ما يكفي من المعرفة والتدريب والمهارات والقدرات لاستخدام أي عنصر ، بما في ذلك الحصول على ومراجعة تعليمات الشركة المصنعة وأدلة التعامل الآمن. لن نكون مسؤولين عن أي إصابات أو خسائر أو أضرار (بما في ذلك الأضرار التي تلحق بالأفراد أو الممتلكات الشخصية أو الوفاة) الناشئة عن استخدام أي عنصر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٧-إن زيارة أو استخدام أي رابط تابع لطرف ثالث من نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هو على مسؤوليتك الخاصة. نحن نخلي مسؤوليتنا فيما يتعلق بالأفعال أو الإغفالات أو الأخطاء أو الإقرارات أو الضمانات أو الانتهاكات أو الإهمال أو عن أي إصابات شخصية أو وفاة أو تلف في الممتلكات أو أضرار أو نفقات أخرى ناتجة عن تفاعلاتك مع أطراف ثالثة عبر نظام<span dir=\"LTR\">&nbsp;EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٨-نحتفظ بشكل صريح بالحق في تصحيح أي أخطاء في التوفر والتسعير على نظام<span dir=\"LTR\">&nbsp;EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٩-إلى أقصى حد يسمح به القانون ، لا نتحمل نحن ومرخصونا أي التزام أو مسؤولية تجاهك أو تجاه أي شخص آخر عن أي خسارة تتكبدها فيما يتعلق بما يلي<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.١-عدم توفر نظام<span dir=\"LTR\">&nbsp;EJARLY (</span>كليًا أو جزئيًا) أو بطئ أدائه ؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٢-أي خطأ أو إغفال في أي معلومات يتم توفيرها من خلال نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٣- أي تعرض للفيروسات أو أي أشكال أخرى من التداخل التي قد تلحق الضرر بنظام الكمبيوتر الخاص بك أو تعرضك للاحتيال عند الوصول إلى نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>أو استخدامه. لتجنب الشك ، فأنت مسؤول عن ضمان العملية التي يمكنك من خلالها الوصول إلى واستخدام نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٤- أي موقع مرتبط من نظام&nbsp;<span dir=\"LTR\">EJARLY</span>. أي رابط على نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;إلى مواقع أخرى لا يعني أي تأييد أو تطبيق</p>\r\n\r\n<p dir=\"RTL\"><strong>١١- حقوق الملكية الفكرية</strong></p>\r\n\r\n<p dir=\"RTL\">١١.١- أنت تقر بأن جميع حقوق الملكية الفكرية (بما في ذلك ، على سبيل المثال لا الحصر ، حسن النية وحقوق النشر) في تطبيق<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>واسم وشعار<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>وأي علامات تجارية ونظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>وأي تقنية أخرى ذات صلة هي ملكنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١١.٢- أنت تقر بأن الحقوق في تطبيق&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>مرخصة (غير مباعة) لك ، وأنه ليس لديك حقوق في ، أو في ، في تطبيق&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>وفي نظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>بخلاف الحق في استخدام كل منها وفقًا مع شروط هذه الاتفاقية.</p>\r\n\r\n<p dir=\"RTL\"><strong>١١.٣-</strong>&nbsp;أنت تقر وتوافق على أن&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;&nbsp;</span></strong>، أو المرخصين التابعين لها ، يمتلكون جميع الحقوق والملكية والمصلحة في الخدمة ، بما في ذلك جميع حقوق الملكية الفكرية والملكية الصناعية وحقوق الملكية المعترف بها في أي مكان في العالم وفي أي قت بأن الخدمة قد تحتوي على معلومات حددتها&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;</span></strong>كمعلومات سرية وتوافق على عدم الكشف عن هذه المعلومات دون الحصول على موافقة كتابية مسبقة من&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>.</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">المحتوى الخاص&nbsp; بك. قد تكون بعض المحتويات التي تشاركها أو تحمّلها ، مثل الصور ، محمية بموجب قوانين الملكية الفكرية. يُقصد بمصطلح &quot;المحتوى&quot; النصوص والصور والصور والصوت والفيديو والرسائل وجميع أشكال البيانات أو الاتصالات الأخرى التي ترسلها أو ترسلها إلى الخدمة أو من خلالها أو فيما يتعلق بها.</li>\r\n	<li dir=\"RTL\">المسؤولية عن المحتوى الخاص بك. أنت وحدك المسؤول عن المحتوى الخاص بك ، وبمجرد نشره على<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;، لا يمكن دائمًا سحبه. أنت تتحمل جميع المخاطر المرتبطة بالمحتوى الخاص بك ، بما في ذلك اعتماد أي شخص على جودته أو دقته أو موثوقيته وأي مخاطر مرتبطة بالمعلومات الشخصية التي تكشف عنها. أنت تقر بأنك تمتلك أو لديك الأذونات اللازمة لاستخدام المحتوى الخاص بك وترخيص استخدامه كما هو موضح هنا. لا يجوز لك الإيحاء بأن المحتوى الخاص بك يتم برعاية أو إقراره بأي شكل من الأشكال بواسطة&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>. قد تعرض نفسك للمسؤولية إذا كان المحتوى الخاص بك ، على سبيل المثال ، يحتوي على مادة خاطئة أو مضللة عن قصد أو تشهيرية ؛ ينتهك أي حق لطرف ثالث ، بما في ذلك أي حقوق نشر أو علامة تجارية أو علامة خدمة أو براءة اختراع أو سر تجاري أو حق أخلاقي أو حق الخصوصية أو حق الدعاية أو أي ملكية فكرية أو حقوق ملكية أخرى ؛ يحتوي على مواد غير قانونية ، بما في ذلك الكلام الذي يحض على الكراهية أو المواد الإباحية ؛ يستغل القاصرين أو يضر بهم بطريقة أخرى ؛ ينتهك أو يدعو إلى انتهاك أي قانون أو لائحة ؛ أو ينتهك هذه الشروط.</li>\r\n	<li dir=\"RTL\">حقنا في استخدام المحتوى الخاص بك. يجوز لنا استخدام المحتوى الخاص بك بعدة طرق مختلفة ، بما في ذلك عرضه علنًا ، وإعادة تنسيقه ، ودمجه في الإعلانات والأعمال الأخرى ، وإنشاء أعمال مشتقة منه ، والترويج له ، وتوزيعه ، والسماح للآخرين بفعل الشيء نفسه فيما يتعلق مع مواقعهم الإلكترونية ومنصاتهم الإعلامية (&quot;الوسائط الأخرى&quot;). على هذا النحو ، فإنك تمنحنا بموجب هذا حقوقًا عالمية ودائمة وغير حصرية وخالية من حقوق الملكية وقابلة للتنازل وقابلة للترخيص من الباطن وقابلة للتحويل ، لاستخدام المحتوى الخاص بك لأي غرض. يرجى ملاحظة أنك تمنح مستخدمي الخدمة وأي وسائط أخرى بشكل نهائي الحق في الوصول إلى المحتوى الخاص بك فيما يتعلق باستخدامهم للخدمة وأي وسائط أخرى. أخيرًا ، أنت تتنازل بشكل نهائي ، وتتسبب في التنازل ، ضد<strong><span dir=\"LTR\">ejarly&nbsp;&nbsp;</span></strong>ومستخدميها عن أي مطالبات وتأكيدات على الحقوق المعنوية أو الإسناد فيما يتعلق بالمحتوى الخاص بك. نعني بكلمة &quot;استخدام&quot; الاستخدام والنسخ والأداء العلني والعرض وإعادة إنتاج وتوزيع وتعديل وترجمة وإزالة وتحليل وتسويق وإعداد أعمال مشتقة من المحتوى الخاص بك</li>\r\n	<li dir=\"RTL\">الملكية. بينك وبين&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;، أنت تملك المحتوى الخاص بك. نحن نملك محتوى&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>، بما في ذلك على سبيل المثال لا الحصر الواجهات المرئية والميزات التفاعلية والرسومات والتصميم والتجميع (بما في ذلك ، على سبيل المثال لا الحصر ، اختيارنا وتنسيقنا وتجميعنا وترتيبه للمحتوى) ، ورمز الكمبيوتر ، والمنتجات ، البرامج وجميع العناصر والمكونات الأخرى للخدمة باستثناء المحتوى الخاص بك وأي محتوى تابع لجهة خارجية.</li>\r\n	<li dir=\"RTL\">أخرى. لا يعكس المحتوى بالضرورة رأي&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>. باستثناء ما يقتضيه القانون ، لسنا ملزمين بالاحتفاظ بنسخ من المحتوى الخاص بك أو تزويدك بها ، ولا نضمن أي سرية فيما يتعلق بالمحتوى الخاص بك. نحتفظ بالحق في إزالة المحتوى الخاص بك أو فحصه أو تعديله أو إعادة وضعه وفقًا لتقديرنا الخاص لأي سبب أو بدون سبب ، ودون إخطارك.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">١٢-&nbsp;<strong>الخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\">١٢.١- أنت توافق على قيامنا بجمع وتخزين والاحتفاظ باسمك والبريد الإلكتروني وكلمة المرور وتاريخ الميلاد ورقم الهاتف وتفاصيل الحساب المصرفي ومعلومات الجهاز ومعلومات الاستخدام داخل التطبيق (مثل إجابات الاستبيانات والردود التي تم النقر عليها والميزات المستخدمة) و معلومات الموقع. أنت توافق أيضًا على تزويدنا باسمك وتفاصيل الاتصال بالشرطة إذا اعتقدنا أنك قد سرقت أي عنصر مستأجر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٢.٢- أنت تقر بأنك قد قرأت وفهمت سياسة الخصوصية الخاصة بنا ، فيما يتعلق بجمع واستخدام معلوماتك الشخصية. بالموافقة على هذه الاتفاقية ، فإنك توافق أيضًا على المعلومات والموافقات والإفصاحات الواردة في سياسة الخصوصية الخاصة بنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣-&nbsp;<strong>عام</strong></p>\r\n\r\n<p dir=\"RTL\">١٣.١- إذا احتجنا إلى الاتصال بك ، فقد نقوم بذلك عن طريق البريد الإلكتروني أو الهاتف ، أو عن طريق نشر إشعار على نظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>أنت توافق على أن هذا يفي بجميع المتطلبات القانونية فيما يتعلق بالاتصالات المكتوبة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٢- لن نكون مسؤولين أو مسؤولين عن أي فشل في أداء ، أو تأخير في أداء ، أي من التزاماتنا بموجب هذه الاتفاقية بسبب فعل أو حدث خارج عن سيطرتنا المعقولة ، بما في ذلك على سبيل المثال لا الحصر فشل شبكات الاتصالات العامة أو الخاصة أو فشل نظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;بسبب وصول طرف ثالث أو فشل النظام أو الجهاز أو خطأ المستخدم<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٣- بالنسبة لنا للتنازل عن حق بموجب هذه الاتفاقية ، يجب أن يكون التنازل كتابيًا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٤- يجوز لنا نقل حقوقنا والتزاماتنا بموجب هذه الاتفاقية إلى كيان آخر ، ومع ذلك ، لن يؤثر ذلك على حقوقك أو التزاماتنا بموجب هذه الاتفاقية</p>\r\n\r\n<p dir=\"RTL\">١٣.٥-البنود التي ، بطبيعتها ، تهدف إلى البقاء بعد إنهاء هذه الاتفاقية تظل سارية المفعول<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٦- إذا كان أي جزء أو حكم من هذه الاتفاقية غير قانوني أو غير قابل للتنفيذ أو غير صالح أو أصبح غير قانوني ، فسيتم تعديل هذا الجزء أو الحكم إلى الحد المطلوب لمعالجة عدم الشرعية أو عدم قابلية التنفيذ أو البطلان. إذا لم يكن التعديل ممكنًا ، فيجب التعامل مع الجزء أو الحكم لجميع الأغراض على أنه منفصل عن هذه الاتفاقية. ستكون بقية شروط هذه الاتفاقية ملزمة لك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٧-تحدد هذه الاتفاقية كل ما يتفق عليه الطرفان فيما يتعلق باستخدامك لنظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;أو استخدام خدمات<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;ويحل محل ويلغي أي شيء تمت مناقشته أو تبادله أو الاتفاق عليه قبل موافقتك على هذه الاتفاقية. أنت تقر بأنك لم تعتمد على أي تمثيل أو ضمان أو اتفاقية تتعلق بنظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;أو خدمات<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;غير المنصوص عليها صراحة في هذه الاتفاقية ، وليس لهذا التمثيل أو الضمان أو الاتفاقية أي تأثير من تاريخ موافقتك على هذه الاتفاقية<span dir=\"LTR\">&nbsp;.</span></p>');
INSERT INTO `pages` (`id`, `en_title`, `ar_title`, `en_description`, `ar_description`) VALUES
(5, 'use', 'use', '<p style=\"text-align:center\"><span style=\"color:#FFD700\"><span style=\"font-size:26px\">كيفية الاستخدام</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#FFD700\"><span style=\"font-size:26px\"><img alt=\"\" src=\"https://ibb.co/wWb1nkj\" /></span></span></p>', '<p style=\"text-align:center\"><span style=\"color:rgb(255, 215, 0); font-size:26px\">كيفية الاستخدام</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>');
INSERT INTO `pages` (`id`, `en_title`, `ar_title`, `en_description`, `ar_description`) VALUES
(6, 'privacy', 'privacy', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>السياسات والإجراءات والخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>شكرًا لك على استخدام&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>تاريخ آخر تعديل:&nbsp;<span dir=\"LTR\">04/08/2021</span></strong></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:center\"><strong>اتفاقية ترخيص المستخدم النهائي (الاتفاقية) هي اتفاقية قانونية بينك (أنت) ومؤسسة قوة لتقنية المعلومات (سجل تجاري رقم ٢٢٥١٤٩٨٩٠٦) المالكة لتطبيق&nbsp;<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>( نحن أو نحن) لاستخدام نظام تأجير وخدمات من شخص إلى شخص عبر موقع و تطبيق إيجارلي&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>١-كيف تنطبق هذه الشروط :</strong></p>\r\n\r\n<p dir=\"RTL\">١.١ -من خلال الوصول إلى او استخدام أي منتج او خدمة نقدمها من تطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;او الموقع الالكتروني واي تقنية اخرئ تابعة او ذات صلة بنظام&nbsp;<span dir=\"LTR\">EJARLY ,</span>&nbsp;والامتثال لهذه الشروط التي تنطبق على جميع المستخدمين والزوار وغيرهم ممن يصلون إلى خدمة&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;فإنك توافق على الامتثال والالتزام بشروط الخدمة هذه (&quot;الشروط&quot;). عندما تُدرج المنتجات والخدمات للإيجار بصفتك &quot;مالكًا&quot; ، فإنك توافق على الامتثال لقواعد المالكين ، وعندما تستأجر منتجات وخدمات من مالك بصفتك &quot;مستأجرًا&quot; ، فإنك توافق على الامتثال لقواعد المستأجرين . إذا كنت لا توافق على أي من سياسة الاجراءات وشروط الاستخدام و الخصوصية ،، فلا يحق لك الوصول الي الخدمة واستخدام تطبيق او موقع&nbsp;<span dir=\"LTR\">EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.2 -يجب قراءة هذه الاتفاقية بالاقتران مع سياسة الخصوصية الخاصة بنا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.3 -تحديثات<span dir=\"LTR\">. EJARLY&nbsp;</span>&nbsp;قد تقوم بتحديث شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه في أي وقت ، وسوف تقوم&nbsp;<span dir=\"LTR\">EJARLY&nbsp;&nbsp;</span>&nbsp;بنشر النسخة المحدثة من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه على الموقع. أنت تدرك وتوافق على أنه سيتم اعتبارك موافقًا على شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة إذا كنت تستخدم الخدمة بعد نشر شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة أنت مسؤول عن مراجعة أحدث إصدار من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; . إذا كنت لا توافق في أي وقت على أي جزء من شروط الاستخدام والسياسات والإجراءات والخصوصية &nbsp;هذه ، فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٢-</strong>&nbsp;<strong>وصف خدمات</strong><span dir=\"LTR\">&nbsp; &nbsp;&nbsp;&nbsp;Ejarly</span>&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>٢.١&nbsp;</strong>&nbsp;<strong>-</strong>&nbsp;إيجارلي&nbsp;<strong><span dir=\"LTR\">(Ejarly)</span></strong>&nbsp;هي منصة تأجير تتيح لأفراد المجتمع مشاركة ممتلكاتهم لبعضهم البعض ، نمكن أصحاب الممتلكات (المؤجرون ) الاستفادة من ممتلكاتهم المركونة والغير مستغلة من كسب المال منها من خلال تأجيرها لأفراد أخرون (المستأجرين )، نقوم بربطهم بالأفراد الذين يحتاجون (المستأجرين )&nbsp; الى أشياء لاستخدام قصير الاجل أو للاستخدام الفردي واستئجارها وتوفير المال . تقوم المنصة على ربط و تسهيل التواصل لعملية التأجير بين الطرفين في بيئة أمنة وموثوقة&nbsp; قدر المستطاع&nbsp;&nbsp;&nbsp; .</p>\r\n\r\n<p dir=\"RTL\">إجارلي<strong><span dir=\"LTR\">&nbsp;(Ejarly)&nbsp;&nbsp;</span></strong>ليست سوى وسيط لأي معاملة بين المالكين والمستأجرين لتأجير العناصر والخدمات على منصة إجارلي&nbsp;<strong><span dir=\"LTR\">( Ejarly)&nbsp;</span></strong>عندما يؤجر المالك منتجًا أو خدمة للمستأجر ، فإنهم يبرمون عقدًا مع بعضهم البعض مباشرة ، وليس مع&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>، لا يمكن اعتبار &nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>مسؤولة ، وإلى أقصى حد يسمح به القانون ، تستبعد المسؤولية عن سلوك استخدامات&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">سوف تساعد&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;في تسهيل حل النزاعات. لا يمكن أن تضمن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;حقيقة أو دقة أو سلامة أو وجود أو شرعية أي منتج أو خدمة مدرجة للإيجار. التحقق من الهوية ليس مصادقة على منتجات المالك أو مصادقة على المستأجر. لا تصادق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;أو تضمن منتجات للإيجار على المنصة. يجب على العملاء توخي الحرص عند استئجار منتج أو خدمات على&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">إذا لم يمتثل المالك أو المستأجر لشروط الخدمة ، يحق لـ&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;إزالة القوائم و / أو إلغاء أي معاملات&nbsp;<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣- وصف المستخدمين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١- &nbsp;الملاك ( المؤجرون )</strong></p>\r\n\r\n<p dir=\"RTL\">مالكين المنتجات&nbsp; الإعلان عن سلع او خدمات للإيجار داخل&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب&nbsp; الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة&nbsp; (&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.١-</strong>&nbsp;بصفتك مالكًا ، عندما تقوم &nbsp;بتأجير عنصر أو تقديم خدمة للمستأجر ، فإنك تتعهد بالامتثال لقواعد وشروط الخدمة الخاصة بالمالكين ، وتقر بأنك تدخل في عقد مباشر مع المستأجر وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong>،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٢-</strong>&nbsp;بصفتك مالكًا ، فإنك تقر بأن المستأجر لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المستأجر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٣</strong>&nbsp;-بصفتك مالكًا ، فإنك توافق على الامتثال لقواعد المالكين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المالكين وستكون مسؤولاً عن أي تعويض للمقترض فيما يتعلق بأي عدم امتثال. يتضمن ذلك التأكد من مطابقة المنتج المدرج للإيجار مع الوصف الموجود على المنصة. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.١.٤ -</strong>&nbsp;أي تعويض للمستأجر عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٥ -</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢- المستأجرين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١-&nbsp;&nbsp;</strong>المستأجرين من يقومون باستئجار منتجات من المالك واستخدامها لوقت مدد بينهم ومن ثم ارجاعة للمالك ، أنت كمستأجر توافق على أنه عند استئجار عنصر او خدمة من مالك في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;، فإنك توافق على الامتثال لقواعد المستأجرين وشروط الخدمة، وتقر بأنك تدخل في عقد مباشر مع المالك وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٢-</strong>&nbsp;بصفتك مستأجرًا ، فإنك تقر بأن المالك لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المالك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٣-</strong>&nbsp;بصفتك المستأجر ، فإنك توافق على الامتثال لقواعد المستأجرين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المستأجرين وستكون مسؤولاً عن أي تعويض للمالك فيما يتعلق بأي عدم امتثال. يتضمن ذلك فقدان أو تلف المنتج الذي استأجرته. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;</span></strong>ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٤-</strong>&nbsp;أي تعويض للمالك عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٥-</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٦-</strong>&nbsp;بصفتك المستأجر أنت تقر وتضمن أنك على دراية بنوع المنتج الذي يتم تأجيره والتعديلات المطلوبة للتشغيل الآمن للمنتج واستخدامه ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٧-</strong>&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٨-</strong>&nbsp;أنت مسؤول مسؤولية كاملة عن سلامتك وسلامة أي طرف ثالث أثناء استخدام المنتج ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩-</strong>&nbsp;<strong>سوف :</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.١-</strong>&nbsp;تعامل المنتج بنفس درجة العناية على الأقل كما لو كانت ملكيتك الخاصة ، وعلى أي حال مع العناية المعقولة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.٢-</strong>&nbsp;إعادة المنتج إلى المُقرض بنفس الحالة التي تلقيتها ذلك في التاريخ والوقت المستحق وفي المكان المحدد في القائمة المقبولة</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.٣-&nbsp;</strong>أنت تدرك أنه ستكون هناك رسوم إضافية إذا تم إرجاع المنتج في وقت أو تاريخ أو موقع مختلف عما هو مذكور في القائمة المقبولة ، بما في ذلك الرسوم المتأخرة أو رسوم الإيجار الإضافية ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠-</strong>&nbsp;<strong>ستضمن أن المنتج:</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.١-</strong>ستضمن أن المنتج&nbsp; يظل ملكية شخصية ولا يصبح عنصرًا أساسيًا في الممتلكات العقارية ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.٢-</strong>ستضمن أن المنتج يتم الاحتفاظ به خاليًا من أي امتيازات أو أعباء ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠.٣-</strong>ستضمن أن المنتج يتم تخزينه في مكان وبيئة آمنة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١-</strong>تقر بأن المُقرض قد يستعيد ملكية المنتج في أي وقت دون إخطارك مسبقًا إذا:</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.١-</strong>&nbsp;تم استخدام المنتج بشكل ينتهك القانون ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٢-</strong>&nbsp;يبدو أنه قد تم التخلي عن المنتج ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣٣.٢.١١.٣-</strong>&nbsp;المنتج تُستخدم في انتهاك لاتفاقية التأجير ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١١.٤-</strong>&nbsp;أنك قدمت تحريفًا للمقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٥-</strong>&nbsp;فشلت في إعادة المنتج عند استحقاقه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٢-&nbsp;</strong>ستدفع للمالك ما يصل إلى قيمة الاستبدال الكاملة للمنتج مقابل جميع الخسائر و / أو الأضرار التي تلحق بالمنتج ، باستثناء حالات التآكل والتلف العادية فقط ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٣-&nbsp;</strong>تقر بأن المنتج يظل ملكية حصرية للمقرض ويخضع للفحص من قبل المُقرض في أي وقت بناءً على طلب المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٤-&nbsp;</strong>أنت تدرك وتقر بأن المنتج مقدم من قبل المُقرض &quot;كما هو&quot; وأن المُقرض لا يقدم أي ضمانات بخلاف تلك المنصوص عليها صراحةً في القسم) &nbsp;أعلاه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٥-&nbsp;</strong><strong>لن تقوم&nbsp;</strong><strong>:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.١-&nbsp;</strong>بإزالة أي ملصقات من المنتج تحدد المُقرض على أنه المالك ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.٢-</strong>&nbsp;تعديل المنتج بأي طريقة دون الحصول على موافقة كتابية مسبقة من المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٤- حسابك الخاص في إجارلي:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١-&nbsp;</strong>&nbsp;من أجل الوصول إلى نظام إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly)&nbsp;</span></strong>&nbsp;والحصول على خدمات &nbsp;إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly) &nbsp;</span></strong>، يجب عليك إنشاء حساب مستخدام :</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.١-&nbsp;</strong>&nbsp;عنوان بريدك الإلكتروني (الحساب)</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٢-&nbsp;</strong>&nbsp;رقم جوالك</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٣-&nbsp;</strong>&nbsp;وبيانات الهوية الوطنية</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٤-&nbsp;</strong>&nbsp;اسم مستخدم</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٥-&nbsp;</strong>&nbsp;وستحتاج إلى إنشاء كلمة مرور لحسابك - نحن نشجعك على استخدام كلمات مرور &quot;قوية&quot;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;(كلمات مرور تستخدم مزيجًا من الأحرف الكبيرة والصغيرة والأرقام والرموز) مع حسابك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢-&nbsp;</strong>&nbsp;&nbsp;يجب أن تبلغ من العمر السن القانوني فوق١٨ سنه ليتيح لك عرض ممتلكاتك او خدمات والتعامل والتأجير من المالك للدخول في اتفاقية ملزمة قانونًا لاستخدام نظام&nbsp;<strong><span dir=\"LTR\">ejarly.&nbsp;</span></strong>إذا كان عمرك أقل من العمر المسموح فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٢-&nbsp;</strong>&nbsp;&nbsp;تقع على عاتقك مسؤولية الحفاظ على سرية تفاصيل تسجيل الدخول الخاصة بك وأي أنشطة تحدث ضمن حسابك. إذا كانت لديك أي مخاوف بشأن إساءة استخدام حسابك ، فيجب عليك التواصل بنا على&nbsp;<strong><span dir=\"LTR\">info@ejarly.net&nbsp;</span></strong>&nbsp;على الفور لإعلامنا<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.٣-</strong>&nbsp;أنت مسؤول عن الحفاظ على سرية كلمة المرور لحسابك وستكون مسؤولاً عن جميع المستخدمين من خلال تسجيلك و / أو تسجيل الدخول ، سواء أكان ذلك مصرحًا به أم غير مصرح به. أنت توافق على إخطارنا فورًا بأي استخدام غير مصرح به للتسجيل أو الحساب أو معلومات الفواتير أو كلمة المرور الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\"><strong>٥-<span dir=\"LTR\">.&nbsp;</span>كيفية استخدام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;:</strong></p>\r\n\r\n<p dir=\"RTL\">بعد إتمام عملية التسجيل من قبل المالك والمستأجر وتوثيق الحساب :</p>\r\n\r\n<p dir=\"RTL\">٥.١- يقوم المؤجرون بإضافة او اعلان ممتلكاته من منتجات وخدمات للتأجير في تطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;بشرط مطابق للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٥.٢- ويقوم المستأجر بتصفح التطبيق لتأجير منتجات وخدمات او طلب منتجات وخدمات من المالك</p>\r\n\r\n<p dir=\"RTL\">٥.٣- طلب تأجير : يمكن للمستأجرين طلب حجز العناصر التي يوفرها المقرضون عن طريق تقديم طلب إلى المُقرض من خلال نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;وإدراج تاريخ بدء الحجز المطلوب وتاريخ اكتمال الحجز وتفاصيل الطلب وإرساله للمالك ،</p>\r\n\r\n<p dir=\"RTL\">٥.٤- الموافقة : سيقوم نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;بإخطار المالك بالطلب المرفوع من المستأجر ويحق للمالك القبول او رفض الطلب مع ذكر السبب وفي حال تم قبول الطلب سوف يقوم النظام بتأكيد الطلب وفتح عملية تأجير موثقة داخل&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;و إبلاغ المستأجر بقبول المالك للطلب ، وتنبيه الطرفين بالتواصل داخل التطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;لتحديد مكان وموعد الاتقاء واكمال العملية ،</p>\r\n\r\n<p dir=\"RTL\">٥.٥- المعاينة : في تاريخ بدء الحجز ، يجب أن يكون كل المالك المستأجر في الموقع المتفق عليه وننصح بإتباع إرشادات السلامة وقت المعاينة حتى يقوم المالك بتسليم العنصر المؤجر إلى المستأجر، المستآجرون مسؤولون ومسؤولون عن العنصر المستأجر خلال فترة الحجز ويجب أن يتعاملوا مع العنصر المستأجر بعناية واحترام. إذا كنت مقترضًا ، فستكون مسؤولاً عن تغطية تكاليف التلف أو استبدال أي أضرار أو خسارة للعنصر المستأجر أثناء الحجز ، بالإضافة إلى أي أضرار مرتبطة بعدم إعادة العنصر المستأجر في تاريخ اكتمال الحجز و إلى الموقع المحدد<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">٥.٥.١- &nbsp;يقوم المالك بمقابلة المستأجر لتسليم المنتج للمستأجر وشرح آلية عمل المنتج وتوثيق المنتج قبل تسليمه للمستأجر عن طريق تصويره بحالته وهوا يعمل ومن ثم إتمام المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٥.٢- يقوم المستأجر بمعاينة المنتج المراد تأجيره والتأكد منه وتوثيق المنتج عن طريق تصويره بحالته قبل الاستلام ومن ثم تأكيد المعاينة</p>\r\n\r\n<p dir=\"RTL\">٥.٦- الدفع : بعد إتمام مرحله المعاينه يتم دفع مبلغ التأجير من المستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٦.١- يقوم المستأجر بدفع مبلغ التأجير للمالك عن طريق وسائل الدفع المتاحه لدئ&nbsp;<span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧-الاستلام: بعد إتمام مرحله الدفع يجب علئ آلمالك تسليم المنتج للمستأجر</p>\r\n\r\n<p dir=\"RTL\">٥.٧.١-يقوم المالك بتسليم المنتج للمستأجر وتأكيد التسليم عن طريق التطبيق<span dir=\"LTR\">&nbsp;EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٧.٢ -يقوم المستأجر بعد استلام المنتج من المالك يقوم المستأجر بتأكيد استلام المنتج عن طريق التطبيق&nbsp;<span dir=\"LTR\">EJARLY</span></p>\r\n\r\n<p dir=\"RTL\">٥.٨-الاسترجاع : عند العودة إلى المالك في الموقع المحدد</p>\r\n\r\n<p dir=\"RTL\">٥.٨.١-المالك&nbsp; سيفحص المالك السلعة المؤجرة للتأكد من أنها في نفس الحالة التي كانت عليها عندما تم تسليمها إلى المستأجر. بعد الفحص ، قد يتم فرض رسوم التنظيف على المستأجر اعتمادًا على حالة العنصر المستأجر وتأكيد استرجاع المنتج .</p>\r\n\r\n<p dir=\"RTL\">٥.٨.٢-يقوم المستأجر بتسليم المنتج للمالك وتمام استرجاع المنتج ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٥.٩- التقييم : يقوم كلا الطرفين بتقييم عملية التأجير</p>\r\n\r\n<p dir=\"RTL\"><strong>٦- يسمح نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;&nbsp;بما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong>&nbsp;&nbsp;<strong>المؤجرون</strong>&nbsp;: &nbsp;مالكين المنتجات &nbsp;الإعلان عن سلع او خدمات للإيجار داخل&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب &nbsp;الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة &nbsp;(&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١-</strong>&nbsp;&nbsp;أنت تقر وتضمن أنك</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.١-</strong>&nbsp;&nbsp;&nbsp;أنت المالك الوحيد للمنتج أو أن لديك وكالة كاملة أو سلطة أخرى لتقديم المنتج إلى المستأجر ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٢-</strong>&nbsp;&nbsp;&nbsp;&nbsp;تم وصف المنتج بدقة في قائمة عرض المنتج ، بما في ذلك الحالة الحالية وأي أخطاء أو عيوب أو مشاكل معروفة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٣-</strong>&nbsp;&nbsp;&nbsp;&nbsp;باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة &nbsp;&nbsp;&nbsp;الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٤-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٥-</strong>&nbsp;&nbsp;&nbsp;&nbsp;يجب ألا تعرض خدمة او منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.٦-</strong>&nbsp;&nbsp;&nbsp;&nbsp;عدم تبادل بيانات التواصل مع المستآجر ويتم التواصل مع المستأجر فقط عن طريق الرسائل داخل التطبيق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمستأجر للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٧-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لا يتم تسليم أي عنصر إلا للمقترض بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.١.٨-</strong>&nbsp;&nbsp;&nbsp;&nbsp;يجب عليك فقط تسليم العنصر إلى الشخص المستآجر المستخدم في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;<strong>٦.١.٩-</strong>&nbsp;&nbsp;&nbsp;&nbsp;لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١٠-</strong>&nbsp;يمكنك إزالة المنتج أو إلغاء اتفاقيتك لإقراض عنصر للمقترض في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار. إذا قمت بإلغاء اتفاقية استئجار عنصر لمستأجر قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي&nbsp;<strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.١.١١-</strong>&nbsp;&nbsp;&nbsp;بصفتك مالكآ (مؤجر) ، فأنت وحدك المسؤول عن تكلفة أي إصلاحات أو تعديلات على المنتج لم تكن ضرورية بسبب الضرر الناجم عن المستأجر او وجود عيوب لم يتم وصفها أو تصويرها في القائمة المنشورة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢-</strong>&nbsp;&nbsp;&nbsp;<strong>بالمستأجر&nbsp;</strong>&nbsp;: عندما توافق على استئجار عنصر مع المالك ، يمنحك المالك حقًا محدودًا لاستخدام هذا العنصر خلال فترة الاستئجار ذات الصلة. هذا الحق شخصي لك ولا يُسمح لك بمنح هذا الحق لأي شخص آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;أنت مسؤول عن ضمان ما يلي<strong><span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١-</strong>&nbsp;أنك تمتثل لجميع القوانين المعمول بها عند استخدام العنصر ؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>٦.٢.٢-</strong>فإنك تقر أنك ستكون قادرًا على دفع الإيجار ولديك أموال لسداد ثمن العناصر المفقودة أو التالفة. قد تتطلب<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>إيداعًا منك&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; يصل إلى القيمة المقدرة (المحددة من قبل المقرض) للبند المستأجر المقترض وتوافق على أنه يمكننا خصم القيمة المقدرة من حسابك او المحفظه في حالة تلف العنصر أو الإخفاق في إرجاع العنصر. بحلول تاريخ العودة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">تاريخ العودة ورسوم</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٣-</strong>&nbsp;أنت توافق على أنه إذا تم إرجاع عنصر ما بعد تاريخ الإرجاع (التاريخ والوقت المتفق عليه لإرجاع عنصر) ، فسيتم فرض رسوم تصل إلى&nbsp;<strong><span dir=\"LTR\">5&nbsp;</span></strong>اضعاف قيمة الإيجار لكل يوم إضافي على تاريخ الإرجاع وتوافق على خصم هذا المبلغ من حسابك الحساب<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٤-</strong>&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٥-</strong>&nbsp;يجب ألا تعرض طلب منتج يتضمن أسلحة نارية أو أسلحة أو مواد إباحية أو محتوى للبالغين أو حيوانات أو أي عناصر يكون من غير القانوني عرضها للتأجير في بلد إقامتك أو في بلد إقامة المقترض. يجوز لنا إزالة أي عناصر معروضة للتأجير إذا كنا نعتقد أن هذه العناصر غير قانونية أو غير أخلاقية أو تضر بسمعتنا،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.٦-</strong>عدم تبادل بيانات التواصل مع المالك ويتم التواصل مع المالك فقط عن طريق الرسائل داخل التطبيق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وعند قيامك بالتواصل بمبادلة بيانات التواصل سوف تتعرض انت والمالك للمسالة والايقاف ودفع الغرامة قدرها ١٠٠٠ ريال</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٧-</strong>&nbsp;لا يتم تسليم أي عنصر إلا للمالك بعد الموافقة ومن خلال مراحل عملية التأجير داخل منصة&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٨-</strong>&nbsp;يجب عليك فقط ارجاع المنتج إلى الشخص المالك المستخدم في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;وليس لأطراف ثالثة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٦.٢.٩-</strong>&nbsp;لك مطلق الحرية في الغاء عملية التأجير في حال المنتج مخالف او مختلف عن المعروض في منصات&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٠-</strong>&nbsp;ستكون مسؤولاً عن أي خسارة أو تلف للعنصر الذي استأجرته. يرجى الاطلاع على الفقرة المعلومات حول كيفية تعاملنا مع الخلافات بين المقترضين والمقرضين ، بما في ذلك أي نزاعات في حالة تلف العنصر أو فقده أو سرقته<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١١-</strong>&nbsp;يمكنك إلغاء طلب تأجير المنتج في أي وقت قبل قبول المقرض للطلب او في أي وقت حتى 48 ساعة قبل بدء فترة الاستئجار ، إذا قمت بإلغاء اتفاقية استئجار عنصر المالك قبل أقل من 48 ساعة من بدء فترة الاستئجار ، فقد نفرض عليك رسوم إلغاء تساوي&nbsp;<strong><span dir=\"LTR\">40</span></strong>٪ من رسوم الاستئجار كامله</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٢-</strong>لك مطلق الحرية في الموافقة على أي طلب تأجير او رفض طلب تأجير مع ذكر سبب الرفض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٣-</strong>&nbsp;أنك تمتثل لأية توجيهات معقولة يقدمها المُقرض من أجل استخدام العنصر بأمان ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٤-</strong>&nbsp;باستثناء ما هو موضح في قائمة عرض المنتج ، المنتج في حالة عمل مناسبة ، تمت صيانته وفقًا لتعليمات الشركة المصنعة وخلال فترة&nbsp;&nbsp;&nbsp; الإيجار المحددة في القائمة المنشورة ، ستعمل بطريقة تعادل إلى حد كبير المنتجات الأخرى من نفس النوع ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٦.٢.١٥-</strong>&nbsp;إذا أخفقت في إرجاع عنصر بحلول الموعد النهائي المتفق عليه ، فيجب عليك الاتصال بالمُقرض و / أو&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;لإعلامهم بمجرد علمك بأنك ستفوت الموعد النهائي. ستحتاج أيضًا إلى الحجز والدفع مقابل الوقت الممتد على الفور. قد لا يكون المُقرض قادرًا على استيعاب التمديد وفي هذه الحالة تقع على عاتقك مسؤولية إعادة العنصر (العناصر) إلى المُقرض خلال إطار زمني يناسب المُقرض. إذا لم تقم بذلك ، فستكون مسؤولاً عن دفع الرسوم المتأخرة ، والتي ستكون وتصل الى&nbsp;<strong><span dir=\"LTR\">5</span></strong>اضعاف رسوم الإيجار عن الفترة التي تأخر فيها العنصر (&quot;الرسوم المتأخرة&quot;). أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;يمكنها خصم هذا المبلغ من بطاقتك أو حسابك المصرفي دون إذن آخر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٧- رسوم الحجز وشروط الدفع</strong></p>\r\n\r\n<p dir=\"RTL\">٧.١ - لا توجد رسوم لإنشاء حساب. ومع ذلك ، فإننا نفرض رسومًا على كل معاملة تتم من خلال نظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span><span dir=\"LTR\">&nbsp;(</span>رسوم المعاملات). على وجه الخصوص ، نحن نفرض رسومًا على<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">٧.٢ - &nbsp;رسوم على كل عملية مكتملة ، عمولة&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;&nbsp;تصل الى (<span dir=\"LTR\">15</span>٪) وهي الرسوم التي يتم عرضها للمالكين بعد انتهاء عملية التأجير ويحق لـ&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>تغيرها بدون اخطار مسبق للمستخدمين ويجب على المستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٣ - &nbsp;رسوم الخدمة سوق يتم احتساب رسوم للخدمه من المستأجرين لكل عمليه تأجير مكتمله تقدر بقيمه تصل الى ٥ ريال ويحق لـ&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>تغيرها بدون اخطار مسبق للمستخدمين ويجب علئ آلمستخدمين متابعة كل تحديث للشروط والاحكام</p>\r\n\r\n<p dir=\"RTL\">٧.٤ - &nbsp;رسوم تمميز المنتج :تمميز المنتج خدمة تقدمها&nbsp;<span dir=\"LTR\">EJARLY</span>للاعلان عن المنتجات لزياده فرصه استأجارها من المستأجرين وتقون بقيمه رمزيه تحدد في الإعلان</p>\r\n\r\n<p dir=\"RTL\"><strong>٧.١ -&nbsp;</strong>&nbsp;<strong>الضريبة :</strong>&nbsp;المالك اوالمستأجر تقر بأنك المسؤول الوحيد عن دفع الضرائب المطبقة (إن وجدت) المستحقة عليك وفقًا لاستخدامك&nbsp; أنت وحدك المسؤول عن جميع الالتزامات الضريبية المرتبطة بمعاملة التأجير الخاصة بك. &quot;الضريبة&quot; تعني أي ضرائب القيمة المضافة (<strong><span dir=\"LTR\">VAT</span></strong>) أو أي ضرائب أخرى قد يُطلب من المُقرض أو المستأجر تحصيلها و / أو تحويل إلى أي وكالات حكومية (&quot;السلطات الضريبية&quot;). تختلف القوانين في الولايات القضائية المختلفة.&nbsp;<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>لا يمكنها ولا تقدم نصائح متعلقة بالضرائب لأي مقرضين . يرجى استشارة مستشارك الضريبي لتحديد المعاملة الضريبية لأنشطتك في الخدمة أنت توافق على تعويض&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>، ومسؤوليها ، ومديريها ، وموظفيها ، والشركات التابعة لها ، والشركات التابعة لها ، والوكلاء ، والخلفاء والمتنازل لهم من وضد أي التزامات أو أضرار أو خسائر أو تكاليف أو مصاريف أو رسوم تسوية (بما في ذلك المحامين المعقولون &#39;&#39; ، والدفاع عنها وحمايتها. الرسوم وتكاليف الدفاع ومصاريف التحقيق وتكاليف الاكتشاف وتكاليف المحكمة) الناشئة عن خرقك لهذا القسم</p>\r\n\r\n<p dir=\"RTL\"><strong>٨- الأمن</strong></p>\r\n\r\n<p dir=\"RTL\">أمن الحساب. الحفاظ على أمان الحساب أمر في غاية الأهمية. أنت وحدك المسؤول عن الحفاظ على سرية كلمة مرور حسابك. أنت توافق على إخطار<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>على الفور إذا علمت بأي استخدام غير مصرح به لكلمة المرور الخاصة بك أو لحسابك تهتم ِ<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;بسلامة وأمن معلوماتك الشخصية. ومع ذلك ، لا يمكننا أن نضمن أن الأطراف الخارجية غير المصرح لها لن تكون قادرة أبدًا على هزيمة إجراءاتنا الأمنية أو استخدام معلوماتك الشخصية لأغراض غير لائقة. أنت تقر بأنك تقدم معلوماتك الشخصية على مسؤوليتك الخاصة<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٩- المسؤولية:</strong>&nbsp;<strong>التفاعلات والنزاعات بين المالك والمستأجر</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">أنت توافق على أنه عندما تؤجر أو تستأجر منتج او خدمة او طلب منتج او خدمة من&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>، فإن معاملة التأجير تكون فقط بينك وبين المالك و / أو المستآجر ، كما هو معمول به ، وأن<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>ليس طرفًا في عملية التأجير. لدى<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>الحق ، وليس الالتزام ، في مراقبة أي نزاع و / أو مساعدته و / أو حله بين المؤجر والمستأجر - بما في ذلك على سبيل المثال وليس الحصر ، من خلال فرض القيمة التقديرية الكاملة للالتزام الحدث الذي تقرر فيه أن المقترض قد سرق أو فقد أو دمر عناصر المالك<strong><span dir=\"LTR\">.</span></strong>في حالة عدم تمكن المالك والمستأجر من حل نزاع بينهما مباشرة ، فقد يطلبان من&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;التوسط في النزاع. قد تقبل&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>أو ترفض مثل هذا الطلب لتكون وسيطًا وفقًا لتقديرها الخاص. إذا قبلت&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;طلب العمل كوسيط ، فيجوز لها فرض رسوم من أي مبالغ تحدد&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>أنها مستحقة الدفع من قبل المستأجر لتعويض المالك عن أي خسارة أو ضرر يلحق بالمالك. العنصر. سنقوم بتحميل هذا المبلغ على المستأجر بالإضافة إلى أي مبالغ يطلب من المستأجر دفعها للمالك ، والتي قد تشمل الرسوم المنسوبة إلى تلك الأيام التي لم يتمكن فيها المالك من إقراض السلع إلى مستأجرين آخرين.</li>\r\n	<li dir=\"RTL\">&nbsp;في غضون إطار زمني معين بعد إكمال عملية التاجير ، يمكن للمؤجرين والمستآجرين ترك مراجعة عامة (&quot;مراجعة&quot;) وتقديم تصنيف نجمي (&quot;تصنيف&quot;) عن بعضهم البعض. تعكس التقييمات أو المراجعات آراء المستخدم الفردي ولا تعكس آراء&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>. لم يتم التحقق من التقييمات والمراجعات من قبل<strong><span dir=\"LTR\">&nbsp;ejarly&nbsp;</span></strong>للتأكد من دقتها وقد تكون غير صحيحة أو مضللة. يجب أن تكون التقييمات والمراجعات دقيقة ولا يجوز أن تحتوي على أي لغة مسيئة أو تشهيرية. يحظر على المستخدمين التلاعب بنظام التقييمات والمراجعات بأي طريقة ، مثل توجيه طرف ثالث لكتابة مراجعة إيجابية أو سلبية عن مستخدم آخر. تعد التقييمات والمراجعات جزءًا من الملف الشخصي العام للمستخدم ويمكن أيضًا أن تظهر في مكان آخر على خدمة<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>جنبًا إلى جنب مع المعلومات الأخرى ذات الصلة مثل عدد معاملات الإقراض وعدد عمليات الإلغاء ومتوسط ​​وقت الاستجابة وأي معلومات أخرى تعتبرها<strong><span dir=\"LTR\">&nbsp;Ejarly&nbsp;</span></strong>ذات صلة<strong><span dir=\"LTR\">&nbsp;.</span></strong></li>\r\n	<li dir=\"RTL\">&nbsp;انت توافق ويحق لـ&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;بتقديم للطرف المتضرر بيانات المستخدم الاخر لتقديمها للجهات المختصة ، ولا يترتب على&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;او الشركة الام أي مسألة قانونية فأنت توافق بذألك</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">٩.٤- &nbsp;يتم تقديم خدمات<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>على أساس &quot;كما هي&quot;. نحن لا نقدم أي ضمانات ، صريحة أو ضمنية ، وننكر بموجب هذا جميع الضمانات الأخرى وننفيها بما في ذلك ، على سبيل المثال لا الحصر ، الضمانات الضمنية أو شروط القابلية للتسويق أو الاستخدام أو الملاءمة لغرض معين أو عدم التعدي على الملكية الفكرية أو أي انتهاك آخر للحقوق في فيما يتعلق باستخدامك لنظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>هذا يعني أننا غير قادرين على الوعد بأن استخدامك لنظام<span dir=\"LTR\">&nbsp;EJASRLY&nbsp;</span>لن ينقطع ، دون تأخير ، أو خالي من الأخطاء أو يلبي توقعاتك ، ولا نقدم أي التزام فيما يتعلق بأداء أو توفر نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>في هذه الاتفاقية و إلى الحد الذي نتمكن فيه من القيام بذلك ، فإننا نستبعد أي التزامات قد ينطوي عليها القانون<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>١٠ - كمستخدم لنظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>، فأنت تفهم وتوافق على ما يلي<span dir=\"LTR\">:</span></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;١٠.١- لن نتحمل نحن أو الشركات التابعة لنا أي مسؤولية تجاهك أو تجاه الآخرين عن أي معاملات غير مصرح بها تتم باستخدام كلمة المرور الخاصة بك أو حسابك أو معلومات الفواتير الخاصة بك ؛ و</p>\r\n\r\n<p dir=\"RTL\">١٠.٢- قد يتسبب الاستخدام غير المصرح به لكلمة المرور الخاصة بك أو لحسابك أو معلومات الفواتير الخاصة بك في تحميلك المسؤولية تجاهنا نحن والمستخدمين الآخرين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٣-عندما تزودنا بمعلوماتك الشخصية ، يجمع نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هذه المعلومات وفقًا لسياسة الخصوصية الخاصة بنا. لن نتدخل نحن والشركات التابعة لنا في المعلومات بشكل تعسفي ، لكننا نحتفظ بالحق في إزالة المعلومات في بعض الظروف المخففة ، مثل عندما يكون لدينا سبب معقول للشك في أن المستخدم قد يكون احتياليًا أو مزيفًا. نحتفظ أيضًا بالحق في اتخاذ خطوات للتحقق من هويتك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٤- إذا تفاعلت مع نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>بأي طريقة أو أنشأت حسابًا ، فإنك تقوم بذلك على مسؤوليتك الخاصة وفهمك لهذه الاتفاقية. نحن لسنا ولن نكون مسؤولين عن أي إجراءات من قبل مستخدم آخر أو فرد أو شركة أو جمعية أو كيان أو مجموعة أخرى قد تضر بك جسديًا أو ماليًا أو لفظيًا أو رقميًا أو تضايقك بأي شكل من الأشكال. نحن نبذل جهودًا معقولة تجاريًا لتوفير مجتمع نزيه وآمن وجدير بالثقة ولكن لا يمكننا أن نكون مسؤولين عن تصرفات الأطراف الثالثة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٥-ليس لدينا سيطرة على سلوك المستخدمين الآخرين لنظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>أو حقيقة أو دقة المعلومات التي قد ينشرها المستخدم على نظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>لا يمكننا ضمان الهوية الحقيقية لأي فرد. أنت مسؤول عن تحديد هوية وملاءمة أي شخص أو كيان قد تتصل به من خلال المنصة. نحن لا نؤيد أي أشخاص يستخدمون أو يسجلون في خدماتنا. ومع ذلك ، فإننا نحتفظ بالحق (لكننا لسنا ملزمين) بالتحقق من هوية المستخدمين بالإضافة إلى توافر وملاءمة العناصر المدرجة للإيجار من قبل المقرضين. نحن لسنا مسؤولين عن أي معلومات خاطئة أو مضللة على الموقع أو النظام الأساسي ولن نكون مسؤولين عن أي أضرار من أي نوع ناتجة عن استخدامك للمنصة أو المعلومات المقدمة على المنصة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٦-استخدام أي عناصر مستأجرة من خلال نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هو على مسؤوليتك الخاصة. أنت وحدك المسؤول عن ضمان أن لديك ما يكفي من المعرفة والتدريب والمهارات والقدرات لاستخدام أي عنصر ، بما في ذلك الحصول على ومراجعة تعليمات الشركة المصنعة وأدلة التعامل الآمن. لن نكون مسؤولين عن أي إصابات أو خسائر أو أضرار (بما في ذلك الأضرار التي تلحق بالأفراد أو الممتلكات الشخصية أو الوفاة) الناشئة عن استخدام أي عنصر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٧-إن زيارة أو استخدام أي رابط تابع لطرف ثالث من نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>هو على مسؤوليتك الخاصة. نحن نخلي مسؤوليتنا فيما يتعلق بالأفعال أو الإغفالات أو الأخطاء أو الإقرارات أو الضمانات أو الانتهاكات أو الإهمال أو عن أي إصابات شخصية أو وفاة أو تلف في الممتلكات أو أضرار أو نفقات أخرى ناتجة عن تفاعلاتك مع أطراف ثالثة عبر نظام<span dir=\"LTR\">&nbsp;EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٨-نحتفظ بشكل صريح بالحق في تصحيح أي أخطاء في التوفر والتسعير على نظام<span dir=\"LTR\">&nbsp;EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">١٠.٩-إلى أقصى حد يسمح به القانون ، لا نتحمل نحن ومرخصونا أي التزام أو مسؤولية تجاهك أو تجاه أي شخص آخر عن أي خسارة تتكبدها فيما يتعلق بما يلي<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.١-عدم توفر نظام<span dir=\"LTR\">&nbsp;EJARLY (</span>كليًا أو جزئيًا) أو بطئ أدائه ؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٢-أي خطأ أو إغفال في أي معلومات يتم توفيرها من خلال نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>؛</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٣- أي تعرض للفيروسات أو أي أشكال أخرى من التداخل التي قد تلحق الضرر بنظام الكمبيوتر الخاص بك أو تعرضك للاحتيال عند الوصول إلى نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>أو استخدامه. لتجنب الشك ، فأنت مسؤول عن ضمان العملية التي يمكنك من خلالها الوصول إلى واستخدام نظام<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>؛</p>\r\n\r\n<p dir=\"RTL\">١٠.١٠.٤- أي موقع مرتبط من نظام&nbsp;<span dir=\"LTR\">EJARLY</span>. أي رابط على نظام&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;إلى مواقع أخرى لا يعني أي تأييد أو تطبيق</p>\r\n\r\n<p dir=\"RTL\"><strong>١١- حقوق الملكية الفكرية</strong></p>\r\n\r\n<p dir=\"RTL\">١١.١- أنت تقر بأن جميع حقوق الملكية الفكرية (بما في ذلك ، على سبيل المثال لا الحصر ، حسن النية وحقوق النشر) في تطبيق<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>واسم وشعار<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>وأي علامات تجارية ونظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>وأي تقنية أخرى ذات صلة هي ملكنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١١.٢- أنت تقر بأن الحقوق في تطبيق&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>مرخصة (غير مباعة) لك ، وأنه ليس لديك حقوق في ، أو في ، في تطبيق&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>وفي نظام&nbsp;<span dir=\"LTR\">EJARLY&nbsp;</span>بخلاف الحق في استخدام كل منها وفقًا مع شروط هذه الاتفاقية.</p>\r\n\r\n<p dir=\"RTL\"><strong>١١.٣-</strong>&nbsp;أنت تقر وتوافق على أن&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;&nbsp;</span></strong>، أو المرخصين التابعين لها ، يمتلكون جميع الحقوق والملكية والمصلحة في الخدمة ، بما في ذلك جميع حقوق الملكية الفكرية والملكية الصناعية وحقوق الملكية المعترف بها في أي مكان في العالم وفي أي قت بأن الخدمة قد تحتوي على معلومات حددتها&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;</span></strong>كمعلومات سرية وتوافق على عدم الكشف عن هذه المعلومات دون الحصول على موافقة كتابية مسبقة من&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>.</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">المحتوى الخاص&nbsp; بك. قد تكون بعض المحتويات التي تشاركها أو تحمّلها ، مثل الصور ، محمية بموجب قوانين الملكية الفكرية. يُقصد بمصطلح &quot;المحتوى&quot; النصوص والصور والصور والصوت والفيديو والرسائل وجميع أشكال البيانات أو الاتصالات الأخرى التي ترسلها أو ترسلها إلى الخدمة أو من خلالها أو فيما يتعلق بها.</li>\r\n	<li dir=\"RTL\">المسؤولية عن المحتوى الخاص بك. أنت وحدك المسؤول عن المحتوى الخاص بك ، وبمجرد نشره على<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;، لا يمكن دائمًا سحبه. أنت تتحمل جميع المخاطر المرتبطة بالمحتوى الخاص بك ، بما في ذلك اعتماد أي شخص على جودته أو دقته أو موثوقيته وأي مخاطر مرتبطة بالمعلومات الشخصية التي تكشف عنها. أنت تقر بأنك تمتلك أو لديك الأذونات اللازمة لاستخدام المحتوى الخاص بك وترخيص استخدامه كما هو موضح هنا. لا يجوز لك الإيحاء بأن المحتوى الخاص بك يتم برعاية أو إقراره بأي شكل من الأشكال بواسطة&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>. قد تعرض نفسك للمسؤولية إذا كان المحتوى الخاص بك ، على سبيل المثال ، يحتوي على مادة خاطئة أو مضللة عن قصد أو تشهيرية ؛ ينتهك أي حق لطرف ثالث ، بما في ذلك أي حقوق نشر أو علامة تجارية أو علامة خدمة أو براءة اختراع أو سر تجاري أو حق أخلاقي أو حق الخصوصية أو حق الدعاية أو أي ملكية فكرية أو حقوق ملكية أخرى ؛ يحتوي على مواد غير قانونية ، بما في ذلك الكلام الذي يحض على الكراهية أو المواد الإباحية ؛ يستغل القاصرين أو يضر بهم بطريقة أخرى ؛ ينتهك أو يدعو إلى انتهاك أي قانون أو لائحة ؛ أو ينتهك هذه الشروط.</li>\r\n	<li dir=\"RTL\">حقنا في استخدام المحتوى الخاص بك. يجوز لنا استخدام المحتوى الخاص بك بعدة طرق مختلفة ، بما في ذلك عرضه علنًا ، وإعادة تنسيقه ، ودمجه في الإعلانات والأعمال الأخرى ، وإنشاء أعمال مشتقة منه ، والترويج له ، وتوزيعه ، والسماح للآخرين بفعل الشيء نفسه فيما يتعلق مع مواقعهم الإلكترونية ومنصاتهم الإعلامية (&quot;الوسائط الأخرى&quot;). على هذا النحو ، فإنك تمنحنا بموجب هذا حقوقًا عالمية ودائمة وغير حصرية وخالية من حقوق الملكية وقابلة للتنازل وقابلة للترخيص من الباطن وقابلة للتحويل ، لاستخدام المحتوى الخاص بك لأي غرض. يرجى ملاحظة أنك تمنح مستخدمي الخدمة وأي وسائط أخرى بشكل نهائي الحق في الوصول إلى المحتوى الخاص بك فيما يتعلق باستخدامهم للخدمة وأي وسائط أخرى. أخيرًا ، أنت تتنازل بشكل نهائي ، وتتسبب في التنازل ، ضد<strong><span dir=\"LTR\">ejarly&nbsp;&nbsp;</span></strong>ومستخدميها عن أي مطالبات وتأكيدات على الحقوق المعنوية أو الإسناد فيما يتعلق بالمحتوى الخاص بك. نعني بكلمة &quot;استخدام&quot; الاستخدام والنسخ والأداء العلني والعرض وإعادة إنتاج وتوزيع وتعديل وترجمة وإزالة وتحليل وتسويق وإعداد أعمال مشتقة من المحتوى الخاص بك</li>\r\n	<li dir=\"RTL\">الملكية. بينك وبين&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;، أنت تملك المحتوى الخاص بك. نحن نملك محتوى&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>، بما في ذلك على سبيل المثال لا الحصر الواجهات المرئية والميزات التفاعلية والرسومات والتصميم والتجميع (بما في ذلك ، على سبيل المثال لا الحصر ، اختيارنا وتنسيقنا وتجميعنا وترتيبه للمحتوى) ، ورمز الكمبيوتر ، والمنتجات ، البرامج وجميع العناصر والمكونات الأخرى للخدمة باستثناء المحتوى الخاص بك وأي محتوى تابع لجهة خارجية.</li>\r\n	<li dir=\"RTL\">أخرى. لا يعكس المحتوى بالضرورة رأي&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>. باستثناء ما يقتضيه القانون ، لسنا ملزمين بالاحتفاظ بنسخ من المحتوى الخاص بك أو تزويدك بها ، ولا نضمن أي سرية فيما يتعلق بالمحتوى الخاص بك. نحتفظ بالحق في إزالة المحتوى الخاص بك أو فحصه أو تعديله أو إعادة وضعه وفقًا لتقديرنا الخاص لأي سبب أو بدون سبب ، ودون إخطارك.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">١٢-&nbsp;<strong>الخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\">١٢.١- أنت توافق على قيامنا بجمع وتخزين والاحتفاظ باسمك والبريد الإلكتروني وكلمة المرور وتاريخ الميلاد ورقم الهاتف وتفاصيل الحساب المصرفي ومعلومات الجهاز ومعلومات الاستخدام داخل التطبيق (مثل إجابات الاستبيانات والردود التي تم النقر عليها والميزات المستخدمة) و معلومات الموقع. أنت توافق أيضًا على تزويدنا باسمك وتفاصيل الاتصال بالشرطة إذا اعتقدنا أنك قد سرقت أي عنصر مستأجر<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٢.٢- أنت تقر بأنك قد قرأت وفهمت سياسة الخصوصية الخاصة بنا ، فيما يتعلق بجمع واستخدام معلوماتك الشخصية. بالموافقة على هذه الاتفاقية ، فإنك توافق أيضًا على المعلومات والموافقات والإفصاحات الواردة في سياسة الخصوصية الخاصة بنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣-&nbsp;<strong>عام</strong></p>\r\n\r\n<p dir=\"RTL\">١٣.١- إذا احتجنا إلى الاتصال بك ، فقد نقوم بذلك عن طريق البريد الإلكتروني أو الهاتف ، أو عن طريق نشر إشعار على نظام<span dir=\"LTR\">&nbsp;EJARLY.&nbsp;</span>أنت توافق على أن هذا يفي بجميع المتطلبات القانونية فيما يتعلق بالاتصالات المكتوبة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٢- لن نكون مسؤولين أو مسؤولين عن أي فشل في أداء ، أو تأخير في أداء ، أي من التزاماتنا بموجب هذه الاتفاقية بسبب فعل أو حدث خارج عن سيطرتنا المعقولة ، بما في ذلك على سبيل المثال لا الحصر فشل شبكات الاتصالات العامة أو الخاصة أو فشل نظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;بسبب وصول طرف ثالث أو فشل النظام أو الجهاز أو خطأ المستخدم<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٣- بالنسبة لنا للتنازل عن حق بموجب هذه الاتفاقية ، يجب أن يكون التنازل كتابيًا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٤- يجوز لنا نقل حقوقنا والتزاماتنا بموجب هذه الاتفاقية إلى كيان آخر ، ومع ذلك ، لن يؤثر ذلك على حقوقك أو التزاماتنا بموجب هذه الاتفاقية</p>\r\n\r\n<p dir=\"RTL\">١٣.٥-البنود التي ، بطبيعتها ، تهدف إلى البقاء بعد إنهاء هذه الاتفاقية تظل سارية المفعول<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٦- إذا كان أي جزء أو حكم من هذه الاتفاقية غير قانوني أو غير قابل للتنفيذ أو غير صالح أو أصبح غير قانوني ، فسيتم تعديل هذا الجزء أو الحكم إلى الحد المطلوب لمعالجة عدم الشرعية أو عدم قابلية التنفيذ أو البطلان. إذا لم يكن التعديل ممكنًا ، فيجب التعامل مع الجزء أو الحكم لجميع الأغراض على أنه منفصل عن هذه الاتفاقية. ستكون بقية شروط هذه الاتفاقية ملزمة لك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">١٣.٧-تحدد هذه الاتفاقية كل ما يتفق عليه الطرفان فيما يتعلق باستخدامك لنظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;أو استخدام خدمات<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;ويحل محل ويلغي أي شيء تمت مناقشته أو تبادله أو الاتفاق عليه قبل موافقتك على هذه الاتفاقية. أنت تقر بأنك لم تعتمد على أي تمثيل أو ضمان أو اتفاقية تتعلق بنظام<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;أو خدمات<span dir=\"LTR\">&nbsp;EJARLY</span>&nbsp;غير المنصوص عليها صراحة في هذه الاتفاقية ، وليس لهذا التمثيل أو الضمان أو الاتفاقية أي تأثير من تاريخ موافقتك على هذه الاتفاقية<span dir=\"LTR\">&nbsp;.</span></p>', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>السياسات والإجراءات والخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>شكرًا لك على استخدام&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>تاريخ آخر تعديل:&nbsp;<span dir=\"LTR\">04/08/2021</span></strong></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:center\"><strong>اتفاقية ترخيص المستخدم النهائي (الاتفاقية) هي اتفاقية قانونية بينك (أنت) ومؤسسة قوة لتقنية المعلومات (سجل تجاري رقم ٢٢٥١٤٩٨٩٠٦) المالكة لتطبيق&nbsp;<span dir=\"LTR\">&nbsp;EJARLY&nbsp;</span>( نحن أو نحن) لاستخدام نظام تأجير وخدمات من شخص إلى شخص عبر موقع و تطبيق إيجارلي&nbsp;<span dir=\"LTR\">EJARLY</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>١-كيف تنطبق هذه الشروط :</strong></p>\r\n\r\n<p dir=\"RTL\">١.١ -من خلال الوصول إلى او استخدام أي منتج او خدمة نقدمها من تطبيق&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;او الموقع الالكتروني واي تقنية اخرئ تابعة او ذات صلة بنظام&nbsp;<span dir=\"LTR\">EJARLY ,</span>&nbsp;والامتثال لهذه الشروط التي تنطبق على جميع المستخدمين والزوار وغيرهم ممن يصلون إلى خدمة&nbsp;<span dir=\"LTR\">EJARLY</span>&nbsp;فإنك توافق على الامتثال والالتزام بشروط الخدمة هذه (&quot;الشروط&quot;). عندما تُدرج المنتجات والخدمات للإيجار بصفتك &quot;مالكًا&quot; ، فإنك توافق على الامتثال لقواعد المالكين ، وعندما تستأجر منتجات وخدمات من مالك بصفتك &quot;مستأجرًا&quot; ، فإنك توافق على الامتثال لقواعد المستأجرين . إذا كنت لا توافق على أي من سياسة الاجراءات وشروط الاستخدام و الخصوصية ،، فلا يحق لك الوصول الي الخدمة واستخدام تطبيق او موقع&nbsp;<span dir=\"LTR\">EJARLY.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.2 -يجب قراءة هذه الاتفاقية بالاقتران مع سياسة الخصوصية الخاصة بنا.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1.3 -تحديثات<span dir=\"LTR\">. EJARLY&nbsp;</span>&nbsp;قد تقوم بتحديث شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه في أي وقت ، وسوف تقوم&nbsp;<span dir=\"LTR\">EJARLY&nbsp;&nbsp;</span>&nbsp;بنشر النسخة المحدثة من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; هذه على الموقع. أنت تدرك وتوافق على أنه سيتم اعتبارك موافقًا على شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة إذا كنت تستخدم الخدمة بعد نشر شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; المحدثة أنت مسؤول عن مراجعة أحدث إصدار من شروط الاستخدام والسياسات والإجراءات والخصوصية&nbsp; . إذا كنت لا توافق في أي وقت على أي جزء من شروط الاستخدام والسياسات والإجراءات والخصوصية &nbsp;هذه ، فعندئذٍ يجب أن تتوقف فورًا عن استخدام الخدمة.</p>\r\n\r\n<p dir=\"RTL\"><strong>٢-</strong>&nbsp;<strong>وصف خدمات</strong><span dir=\"LTR\">&nbsp; &nbsp;&nbsp;&nbsp;Ejarly</span>&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>٢.١&nbsp;</strong>&nbsp;<strong>-</strong>&nbsp;إيجارلي&nbsp;<strong><span dir=\"LTR\">(Ejarly)</span></strong>&nbsp;هي منصة تأجير تتيح لأفراد المجتمع مشاركة ممتلكاتهم لبعضهم البعض ، نمكن أصحاب الممتلكات (المؤجرون ) الاستفادة من ممتلكاتهم المركونة والغير مستغلة من كسب المال منها من خلال تأجيرها لأفراد أخرون (المستأجرين )، نقوم بربطهم بالأفراد الذين يحتاجون (المستأجرين )&nbsp; الى أشياء لاستخدام قصير الاجل أو للاستخدام الفردي واستئجارها وتوفير المال . تقوم المنصة على ربط و تسهيل التواصل لعملية التأجير بين الطرفين في بيئة أمنة وموثوقة&nbsp; قدر المستطاع&nbsp;&nbsp;&nbsp; .</p>\r\n\r\n<p dir=\"RTL\">إجارلي<strong><span dir=\"LTR\">&nbsp;(Ejarly)&nbsp;&nbsp;</span></strong>ليست سوى وسيط لأي معاملة بين المالكين والمستأجرين لتأجير العناصر والخدمات على منصة إجارلي&nbsp;<strong><span dir=\"LTR\">( Ejarly)&nbsp;</span></strong>عندما يؤجر المالك منتجًا أو خدمة للمستأجر ، فإنهم يبرمون عقدًا مع بعضهم البعض مباشرة ، وليس مع&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>، لا يمكن اعتبار &nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>مسؤولة ، وإلى أقصى حد يسمح به القانون ، تستبعد المسؤولية عن سلوك استخدامات&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">سوف تساعد&nbsp;<strong><span dir=\"LTR\">Ejarly&nbsp;</span></strong>&nbsp;في تسهيل حل النزاعات. لا يمكن أن تضمن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;حقيقة أو دقة أو سلامة أو وجود أو شرعية أي منتج أو خدمة مدرجة للإيجار. التحقق من الهوية ليس مصادقة على منتجات المالك أو مصادقة على المستأجر. لا تصادق&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;أو تضمن منتجات للإيجار على المنصة. يجب على العملاء توخي الحرص عند استئجار منتج أو خدمات على&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\">إذا لم يمتثل المالك أو المستأجر لشروط الخدمة ، يحق لـ&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;إزالة القوائم و / أو إلغاء أي معاملات&nbsp;<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣- وصف المستخدمين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١- &nbsp;الملاك ( المؤجرون )</strong></p>\r\n\r\n<p dir=\"RTL\">مالكين المنتجات&nbsp; الإعلان عن سلع او خدمات للإيجار داخل&nbsp;<strong><span dir=\"LTR\">ejarly</span></strong>&nbsp;( ويتعهد أصحاب الممتلكات &quot;المؤجرون&quot; بموجب&nbsp; الشروط المطبقة على الإقراض. إذا كنت مقرضًا ، فإنك توافق بموجب هذا على الشروط التالية فيما يتعلق بكل قائمة منتجات تنشرها أنت أو نيابة عنك من خلال الخدمة&nbsp; (&quot;قائمة عرض المنتج&nbsp; )</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.١-</strong>&nbsp;بصفتك مالكًا ، عندما تقوم &nbsp;بتأجير عنصر أو تقديم خدمة للمستأجر ، فإنك تتعهد بالامتثال لقواعد وشروط الخدمة الخاصة بالمالكين ، وتقر بأنك تدخل في عقد مباشر مع المستأجر وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">Ejarly.</span></strong>،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٢-</strong>&nbsp;بصفتك مالكًا ، فإنك تقر بأن المستأجر لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المستأجر<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٣</strong>&nbsp;-بصفتك مالكًا ، فإنك توافق على الامتثال لقواعد المالكين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المالكين وستكون مسؤولاً عن أي تعويض للمقترض فيما يتعلق بأي عدم امتثال. يتضمن ذلك التأكد من مطابقة المنتج المدرج للإيجار مع الوصف الموجود على المنصة. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.١.٤ -</strong>&nbsp;أي تعويض للمستأجر عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.١.٥ -</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢- المستأجرين</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١-&nbsp;&nbsp;</strong>المستأجرين من يقومون باستئجار منتجات من المالك واستخدامها لوقت مدد بينهم ومن ثم ارجاعة للمالك ، أنت كمستأجر توافق على أنه عند استئجار عنصر او خدمة من مالك في&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;، فإنك توافق على الامتثال لقواعد المستأجرين وشروط الخدمة، وتقر بأنك تدخل في عقد مباشر مع المالك وليس عقدًا مع&nbsp;<strong><span dir=\"LTR\">ejarly.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٢-</strong>&nbsp;بصفتك مستأجرًا ، فإنك تقر بأن المالك لا يمثل أو يتحكم فيه&nbsp;<strong><span dir=\"LTR\">Ejarly.&nbsp;</span></strong>أنت توافق على أن&nbsp;<strong><span dir=\"LTR\">Ejarly</span></strong>&nbsp;ليست مسؤولة عن أي التزام أو خسارة تتكبدها فيما يتعلق بأي فعل أو إغفال من قبل المالك<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٣-</strong>&nbsp;بصفتك المستأجر ، فإنك توافق على الامتثال لقواعد المستأجرين. أنت مسؤول مسؤولية كاملة عن أي عدم امتثال لقواعد المستأجرين وستكون مسؤولاً عن أي تعويض للمالك فيما يتعلق بأي عدم امتثال. يتضمن ذلك فقدان أو تلف المنتج الذي استأجرته. أنت تقر بأن&nbsp;<strong><span dir=\"LTR\">ejarly&nbsp;</span></strong>ليست مسؤولة عن</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٤-</strong>&nbsp;أي تعويض للمالك عن خرق اتفاقية الإيجار الخاصة بك بأي شكل من الأشكال</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٥-</strong>&nbsp;أي التزام بالتعويض عن مسؤوليتك التي قد تتحملها في حالة عدم الامتثال<strong><span dir=\"LTR\">.</span></strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٦-</strong>&nbsp;بصفتك المستأجر أنت تقر وتضمن أنك على دراية بنوع المنتج الذي يتم تأجيره والتعديلات المطلوبة للتشغيل الآمن للمنتج واستخدامه ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٧-</strong>&nbsp;لديك الأهلية القانونية والسلطة الكاملة للدخول في اتفاقية الإيجار ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٨-</strong>&nbsp;أنت مسؤول مسؤولية كاملة عن سلامتك وسلامة أي طرف ثالث أثناء استخدام المنتج ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩-</strong>&nbsp;<strong>سوف :</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.١-</strong>&nbsp;تعامل المنتج بنفس درجة العناية على الأقل كما لو كانت ملكيتك الخاصة ، وعلى أي حال مع العناية المعقولة ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.٩.٢-</strong>&nbsp;إعادة المنتج إلى المُقرض بنفس الحالة التي تلقيتها ذلك في التاريخ والوقت المستحق وفي المكان المحدد في القائمة المقبولة</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.٣-&nbsp;</strong>أنت تدرك أنه ستكون هناك رسوم إضافية إذا تم إرجاع المنتج في وقت أو تاريخ أو موقع مختلف عما هو مذكور في القائمة المقبولة ، بما في ذلك الرسوم المتأخرة أو رسوم الإيجار الإضافية ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠-</strong>&nbsp;<strong>ستضمن أن المنتج:</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.١-</strong>ستضمن أن المنتج&nbsp; يظل ملكية شخصية ولا يصبح عنصرًا أساسيًا في الممتلكات العقارية ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١٠.٢-</strong>ستضمن أن المنتج يتم الاحتفاظ به خاليًا من أي امتيازات أو أعباء ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٠.٣-</strong>ستضمن أن المنتج يتم تخزينه في مكان وبيئة آمنة ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١-</strong>تقر بأن المُقرض قد يستعيد ملكية المنتج في أي وقت دون إخطارك مسبقًا إذا:</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.١-</strong>&nbsp;تم استخدام المنتج بشكل ينتهك القانون ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٢-</strong>&nbsp;يبدو أنه قد تم التخلي عن المنتج ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣٣.٢.١١.٣-</strong>&nbsp;المنتج تُستخدم في انتهاك لاتفاقية التأجير ،</p>\r\n\r\n<p dir=\"RTL\">&nbsp;<strong>٣.٢.١١.٤-</strong>&nbsp;أنك قدمت تحريفًا للمقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١١.٥-</strong>&nbsp;فشلت في إعادة المنتج عند استحقاقه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٢-&nbsp;</strong>ستدفع للمالك ما يصل إلى قيمة الاستبدال الكاملة للمنتج مقابل جميع الخسائر و / أو الأضرار التي تلحق بالمنتج ، باستثناء حالات التآكل والتلف العادية فقط ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٣-&nbsp;</strong>تقر بأن المنتج يظل ملكية حصرية للمقرض ويخضع للفحص من قبل المُقرض في أي وقت بناءً على طلب المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٤-&nbsp;</strong>أنت تدرك وتقر بأن المنتج مقدم من قبل المُقرض &quot;كما هو&quot; وأن المُقرض لا يقدم أي ضمانات بخلاف تلك المنصوص عليها صراحةً في القسم) &nbsp;أعلاه ؛</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.١٥-&nbsp;</strong><strong>لن تقوم&nbsp;</strong><strong>:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.١-&nbsp;</strong>بإزالة أي ملصقات من المنتج تحدد المُقرض على أنه المالك ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٣.٢.٩.١٥.٢-</strong>&nbsp;تعديل المنتج بأي طريقة دون الحصول على موافقة كتابية مسبقة من المُقرض ،</p>\r\n\r\n<p dir=\"RTL\"><strong>٤- حسابك الخاص في إجارلي:</strong></p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١-&nbsp;</strong>&nbsp;من أجل الوصول إلى نظام إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly)&nbsp;</span></strong>&nbsp;والحصول على خدمات &nbsp;إجارلي&nbsp;<strong><span dir=\"LTR\">(ejarly) &nbsp;</span></strong>، يجب عليك إنشاء حساب مستخدام :</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.١-&nbsp;</strong>&nbsp;عنوان بريدك الإلكتروني (الحساب)</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٢-&nbsp;</strong>&nbsp;رقم جوالك</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٣-&nbsp;</strong>&nbsp;وبيانات الهوية الوطنية</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٤-&nbsp;</strong>&nbsp;اسم مستخدم</p>\r\n\r\n<p dir=\"RTL\"><strong>٤.١.٥-&nbsp;</strong>&nbsp;وستحتاج إلى إنشاء كلمة مرور لحسابك - نحن نشجعك على استخدام كلمات مرور &quot;قوية&quot;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;(كلمات مرور تستخدم مزيجًا من الأحرف الكبيرة والص