(33, 'كاميرا نيكون ٩٠', 'كاميرا نيكون ٩٠', 'وثق رحلتك بأكملها في صورة مع كاميرا نيكون كولبيكس بي 900 بوينت اند شوت. تتميز هذه الكاميرا بقوة تكبير مذهلة. حيث توفر تقريبًا بصريًا يبلغ 83x مرة، لتتمكن من التقاط صور الأشياء البعيدة بجودة واضحة وضوح الشمس. إنها صغيرة الحجم وتمتاز بقبضة ثابتة. يتم تشغيل المحدد البصري الإلكتروني عالي الدقة تلقائيًا عند رفع الكاميرا إلى مستوى عينك. تعمل الكاميرا بواسطة بطارية قوية تمكنك من التقاط ما يصل إلى 360 لقطة لكل شحنة.', 'وثق رحلتك بأكملها في صورة مع كاميرا نيكون كولبيكس بي 900 بوينت اند شوت. تتميز هذه الكاميرا بقوة تكبير مذهلة. حيث توفر تقريبًا بصريًا يبلغ 83x مرة، لتتمكن من التقاط صور الأشياء البعيدة بجودة واضحة وضوح الشمس. إنها صغيرة الحجم وتمتاز بقبضة ثابتة. يتم تشغيل المحدد البصري الإلكتروني عالي الدقة تلقائيًا عند رفع الكاميرا إلى مستوى عينك. تعمل الكاميرا بواسطة بطارية قوية تمكنك من التقاط ما يصل إلى 360 لقطة لكل شحنة.', 99, '[3]', 0, 8, '[1]', 1, 5180, 150, 500, 700, 3, 296, 1, 0, '49.600170347839594', '25.360198042766914', 0, '2021-08-04 19:29:03', '2021-08-15 03:52:46'),
