INSERT INTO `support_help` (`id`, `ar_title`, `en_title`, `ar_desc`, `en_desc`) VALUES
(6, 'لدي سؤال او ملاحظة ؟', 'لدي سؤال او ملاحظة ؟', 'سعيدين بخدمتك يرجئ تعبئة النموذج', 'سعيدين بخدمتك يرجئ تعبئة النموذج'),
(7, 'كيف اقوم بإلغاء طلب تأجير آو طلب لمنتج ؟', 'كيف اقوم بإلغاء طلب تأجير آو طلب لمنتج ؟', 'في حال طلب جديد قبل قبول مالك المنتج للطلب قم برفع طلب لخدمة العملاء توضح سبب الالغاء ليتم الالغاء\r\nوفي حال تم قبول الطلب بإمكانك الغاء الطلب من خلال مراحل عملية التأجير مع ذكر السبب', 'في حال طلب جديد قبل قبول مالك المنتج للطلب قم برفع طلب لخدمة العملاء توضح سبب الالغاء ليتم الالغاء\r\nوفي حال تم قبول الطلب بإمكانك الغاء الطلب من خلال مراحل عملية التأجير مع ذكر السبب'),
(8, 'لماذا تم حذف إعلاني ؟', 'لماذا تم حذف إعلاني ؟', 'اذا تم حذف إعلانك لمنتج او طلب لمنتج فهو النظام يقوم بمراقبة الاعضاء الذين يشتبه في قيامهم بوضع اعلانات مخالفة لنظام المنصة او بسبب البلاغات المرفوعة من المستخدمين او أسباب أخرى لتقديم استفسار عبر هذه النموذج', 'اذا تم حذف إعلانك لمنتج او طلب لمنتج فهو النظام يقوم بمراقبة الاعضاء الذين يشتبه في قيامهم بوضع اعلانات مخالفة لنظام المنصة او بسبب البلاغات المرفوعة من المستخدمين او أسباب أخرى لتقديم استفسار عبر هذه النموذج'),
(9, 'لم يتم قبول طلبي او استفساري من المالك ؟', 'لم يتم قبول طلبي او استفساري من المالك ؟', 'بشكل تلقائى لدئ المالك مهلة قبول للطلب ٢٤ ساعه في حال لم يقبل سوف يتم الغاء الطلب \r\nوفي حال لم يتم الرد على الاستفسارات يرجئ تقديم طلب لخدمة العملاء ليتم اتخاذ الاجراءات مع المالك', 'بشكل تلقائى لدئ المالك مهلة قبول للطلب ٢٤ ساعه في حال لم يقبل سوف يتم الغاء الطلب \r\nوفي حال لم يتم الرد على الاستفسارات يرجئ تقديم طلب لخدمة العملاء ليتم اتخاذ الاجراءات مع المالك'),
(10, 'كيف اقوم بتحديد سعر التأجير ؟', 'كيف اقوم بتحديد سعر التأجير ؟', 'وفقآ للمعاير العالمية بتحديد سعر الايجار باليوم يختلف من منتج الئ اخر ولاكن الاغلب يتماشى على قاعدة واحد تقدر من ٢ الى ٥ ٪ من قيمة المنتج تمثل سعرالتأجير لليوم', 'وفقآ للمعاير العالمية بتحديد سعر الايجار باليوم يختلف من منتج الئ اخر ولاكن الاغلب يتماشى على قاعدة واحد تقدر من ٢ الى ٥ ٪ من قيمة المنتج تمثل سعرالتأجير لليوم'),
(11, 'ماذا لو اكمل عملية التآجير خارج المنصة', 'ماذا لو اكمل عملية التآجير خارج المنصة', 'سوف تعرض نفسك للاحتيال او السرقة و سيتم تطبيق الغرامة المحدد في السياسات والاجراءات على الطرفين و ايقاف حسابات جميع الاطراف', 'سوف تعرض نفسك للاحتيال او السرقة و سيتم تطبيق الغرامة المحدد في السياسات والاجراءات على الطرفين و ايقاف حسابات جميع الاطراف'),
(12, 'لقد تعرضت للسب و الشتم من عضو، ماهو الاجراء؟', 'لقد تعرضت للسب و الشتم من عضو، ماهو الاجراء؟', 'نرجو المراسلة عبر هذا النموذج وذكر التفاصيل مع ذكر اسم مستخدم الطرف الاخر ليتم التآكد من المحادثة وبعد التآكد سوف نقوم بتزويدك  بيانات المستخدم الاخر لتقوم بتقدم شكوى لدى أقرب مركز شرطة.', 'نرجو المراسلة عبر هذا النموذج وذكر التفاصيل مع ذكر اسم مستخدم الطرف الاخر ليتم التآكد من المحادثة وبعد التآكد سوف نقوم بتزويدك  بيانات المستخدم الاخر لتقوم بتقدم شكوى لدى أقرب مركز شرطة.'),
(13, 'لقد تعرضت للاحتيال، ماهو الاجراء؟', 'لقد تعرضت للاحتيال، ماهو الاجراء؟', 'نرجو المراسلة عبر هذا النموذج وذكر التفاصيل مع ذكر اسم المستخدم للطرف الاخر ورقم عملية التآجير. ليتم التآكد التفاصيل وبعد التآكد سوف نقوم بتزويدك  بيانات المستخدم الاخر لتقوم بتقدم شكوى لدى أقرب مركز شرطة', 'نرجو المراسلة عبر هذا النموذج وذكر التفاصيل مع ذكر اسم المستخدم للطرف الاخر ورقم عملية التآجير. ليتم التآكد التفاصيل وبعد التآكد سوف نقوم بتزويدك  بيانات المستخدم الاخر لتقوم بتقدم شكوى لدى أقرب مركز شرطة');
